  'AdminAdvparametersHelp' => 
  array (
    '-- Choose --' => '-- Vælg --',
    'or' => 'eller',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'Brug denne indstilling til at knytte data (varer, moduler osv.) på samme måde for hver valgt butik.',
    'Click here to display the shops in the %name% shop group' => 'Klik her for at vise butikkerne i %name% butiksgruppen',
    'Click here to display the URLs of the %name% shop' => 'Klik her for at vise URL-adresserne for %name% butikken',
    'Click here to display the list of shop groups' => 'Klik her for at vise listen over butikgrupper',
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'Advarsel: Det anbefales ikke, at aktivere funktionen "dele kunder" og "dele ordrer"; når først denne funktion har været aktiveret og kunder eller ordrer er oprettet, vil du ikke kunne deaktivere disse funktioner igen. Hvis du har brug for disse funktioner, overvej da at bruge flere funktioner i stedet for flere butikker.',
    'Once this option is enabled, the shops in this group will share customers. If a customer registers in any one of these shops, the account will automatically be available in the others shops of this group.' => 'Når denne option er aktivet vil butikker i denne gruppedele kunder. Hvis en kunde registrere sig i en butik vil vedkommendes konto automatisk være tilgængelig fra de øvrige butikker i gruppen.',
    'Warning: you will not be able to disable this option once you have registered customers.' => 'Advarsel: du vil ikke være i stand til at deaktivere denne mulighed, så snart du har registrerede kunder.',
    'Once this option is enabled (which is only possible if customers and available quantities are shared among shops), the customer\'s cart will be shared by all shops in this group. This way, any purchase started in one shop will be able to be completed in another shop from the same group.' => 'Når denne valgmulighed er aktiv (hvilket kun er muligt, hvis kunder og tilgængeligt antal er delt af butikkerne), vil kundernes indkøbskurv blive delt mellem alle butikker i denne gruppe. På den måde, kan en handel, der starter i en butik blive ført videre og afsluttet i en anden butik fra samme gruppe.',
    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => 'Advarsel: Du vil ikke kunne inaktivere denne option efter du er begyndt at acceptere ordre.',
    'Enable or disable this shop group?' => 'Aktiver eller deaktiver denne butikgruppe?',
    'If you want to add a virtual URL, you need to activate URL rewriting on your web server and enable Friendly URL option.' => 'Hvis du ønsker at tilføje en virtuel URL skal du aktivere URL genskrivning (URL rewriting) på din web server samt aktivere venlig URL (Friendly URL).',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => 'Du kan bruge denne valgmulighed, hvis du ønsker at oprette en butik, med et URL som ikke eksisterer på din server (f.eks. Hvis du ønsker at din butik har muligheden med linket. www.min-prestashop.com/min-butik/sko/. Skal du sætte /sko i dette felt, forudsat at /min-butik er din fysiske URL).',
    'URL rewriting must be activated on your server to use this feature.' => 'URL omskrivning skal være aktiveret på din server, for at du kan bruge denne funktion.',
    'If you set this URL as the Main URL for the selected shop, all URLs set to this shop will be redirected to this URL (you can only have one Main URL per shop).' => 'Hvis du angiver denne URL som hoved URL for den valgte butik, så vil alle URLer til denne butik blive omdirigeret til denne URL (du kan kun have en hoved URL pr. butik).',
    'Since the selected shop has no main URL, you have to set this URL as the Main URL.' => 'Siden den valgte butik ikke har en hoved URL, skal du angive denne URL som hoved URL.',
    'The selected shop already has a Main URL. Therefore, if you set this one as the Main URL, the older Main URL will be set as a regular URL.' => 'Den valgte butik har allerede hoved URL. Hvis du derfor sætter denne som hoved URL, vil den ældre hoved URL blive sat som en almindelig URL.',
    'This is the physical folder for your store on the web server. Leave this field empty if your store is installed on the root path. For instance, if your store is available at www.example.com/my-store/, you must input my-store/ in this field.' => 'Fysisk placering af din butiksmappe på server. Lad dette felt være tomt, hvis din butik er installeret i roden (f.eks. hvis din butik er tilgængelig på www.min-prestashop.dk/min-butik/ - skal du skrive min-butik/ i dette felt).',
    'Warning: URL rewriting (e.g. mod_rewrite for Apache) seems to be disabled. If your Virtual URL doesn\'t work, please check with your hosting provider on how to activate URL rewriting.' => 'Advarsel: URL omskrivning (f.eks. mod_omskrivning til Apache) ser ud til at være deaktiveret. Hvis dine webadresse ikke virker, skal du venligst kontrollere med din værtsudbyder, hvordan du aktiverer URL omskrivning.',
    'Ignore this field if you don\'t use the Multistore tool. If you leave this field empty, the default shop will be used.' => 'Ignorer dette felt, hvis du ikke bruger Multistore værktøj. Hvis du lader dette felt være blankt, vil standard butik blive brugt.',
    'A category root is where a category tree can begin. This is used with multistore.' => 'En hovedkategori er der, hvor en kategoritræstrukturen kan begynde. Dette bruges med Multistore.',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes)' => 'Aktiver avanceret lagerstyring på vare (0 = Nej, 1 = Ja)',
    '0 = Use quantity set in product, 1 = Use quantity from warehouse.' => '0 = Anvend mængde sat på vare, 1 = Anvend mængde fra lager.',
    'ID of the warehouse to set as storage.' => 'ID på lager som skal anvendes som lagring.',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes).' => 'Aktiver avanceret lagerstyring på vare (0 = Nej, 1 = Ja).',
    'This will add directives to your .htaccess file, which should improve caching and compression.' => 'Dette vil tilføje direktiver til din .htaccess fil, som bør forbedre caching og komprimering.',
    'Enable or disable debug mode.' => 'Aktiver eller deaktiver fejlfindingstilstanden.',
    'Name of the second domain of your shop, (e.g. myshop-media-server-1.com). If you do not have another domain, leave this field blank.' => 'Navn på domæne nummer 2 i din butik (f.eks. minbutik-media-server-1.com). Hvis du ikke har et andet domæne, skal dette felt blot være blank.',
    'Name of the third domain of your shop, (e.g. myshop-media-server-2.com). If you do not have another domain, leave this field blank.' => 'Navn på domæne nummer 3 i din butik (f.eks. minbutik-media-server-2.com). Hvis du ikke har et andet domæne, skal dette felt blot være blank.',
    'Name of the fourth domain of your shop, (e.g. myshop-media-server-3.com). If you do not have another domain, leave this field blank.' => 'Navn på domæne nummer 4 i din butik (f.eks. minbutik-media-server-3.com). Hvis du ikke har et andet domæne, skal dette felt blot være blank.',
    'Choose "No" to disable Product Combinations.' => 'Vælg "Nej" for at deaktivere varekombinationer.',
    'You cannot set this parameter to No when combinations are already used by some of your products' => 'Du kan ikke sætte denne parameter til Nej når der allerede er nogle af dine varer der anvender kombinationer',
    'Choose "No" to disable Product Features.' => 'Vælg "Nej" for at deaktivere vareegenskaber.',
    'Choose "No" to disable Customer Groups.' => 'Vælg "Nej" for at deaktivere kundegrupper.',
    'Should be enabled if you want to avoid to store the smarty cache on NFS.' => 'Skal være aktiveret, hvis du ønsker at undgå at gemme smart cachen på NFS.',
    'New modules and updates are displayed on the modules page.' => 'Nye moduler og opdateringer vises på modulsiden.',
    'Check the IP address of the cookie in order to prevent your cookie from being stolen.' => 'Kontroller IP adressen på cookie for at undgå, at denne stjæles.',
    'Set the amount of hours during which the front office cookies are valid. After that amount of time, the customer will have to log in again.' => 'Angiv hvor mange timer cookies er gyldige i front-office. Efter dette tidsrum, er kunden nødt til at logge ind igen.',
    'When you access your back office and decide to stay logged in, your cookies lifetime defines your browser session. Set here the number of hours during which you want them valid before logging in again.' => 'Når du tilgår dit back office og beslutter at forblive logget på, så definerer din cookies levetid din browsers session. Sæt her antallet af timer som du ønsker de skal være gyldige inden du logger på igen.',
    'Choose a stability level for the modules downloaded from the Addons Marketplace. All zips pushed on Addons are in stable state unless stated otherwise.' => 'Vælg et stabilitetsniveau for modulerne downloadet fra Addons markedspladsen. Alle zip der udgives på Addons er i stabil tilstand, med mindre andet er angivet.',
    'Allows you to declare if your cookie should be restricted to a first-party or same-site context.' => 'Giver dig mulighed for at angive om din cookie skal være begrænset til føste-parts eller same-site kontekst.',
    'Define the upload limit for a downloadable product (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Angiv upload-grænsen for en vare, der kan downloades (i megabytes). Denne værdi må ikke overstige den maksimalt tilladte filstørrelse, som din server tillader at uploade (aktuelt: %size% MB).',
    'Define the upload limit for an image (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Angiv upload-grænsen for et billede (i megabytes). Denne værdi kan ikke overstige den maksimalt tilladte filstørrelse, som din server tillader at uploade (aktuelt: %size% MB).',
    'Set the maximum size allowed for attachment files (in megabytes). This value has to be lower than or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Sæt den maksimalt tilladte størrelse for vedhæftede filer (i megabytes). Denne værdi skal være lavere end eller lige med den maksimale fil upload tilladt af din server (aktuelt: %size% MB).',
    'Drop existing tables during import.' => 'Drop eksisterende tabeller under import.',
    'If enabled, the backup script will drop your tables prior to restoring data. (ie. "DROP TABLE IF EXISTS")' => 'Hvis aktiveret, så vil backup scriptet slette dine tabeller inden data genskabes. (fx "DROP TABLE IF EXISTS")',
    'Where customers send messages from the order page.' => 'Når kunderne sender en besked fra ordresiden.',
    'Fully qualified domain name (keep this field empty if you don\'t know).' => 'Fuldt kvalificeret domænenavn (lad feltet være tomt, hvis du ikke ved det).',
    'IP address or server name (e.g. smtp.mydomain.com).' => 'IP adresse eller servernavn (f.eks. smtp.mydomain.dk).',
    'Leave blank if not applicable.' => 'Efterlad blankt, hvis ikke relevant.',
    'SSL does not seem to be available on your server.' => 'SSL ser ikke ud til at være tilgængeligt på din server.',
    'Port number to use.' => 'Portnummer, der skal bruges.',
    'If enabled, the product\'s reference number MUST be unique!' => 'Hvis aktiveret, SKAL varens referencenummer være unikt!',
    'e.g. 1; Blouse; 129.90; 5' => 'fx 1; Bluse; 129.90; 5',
    'e.g. Blouse; red.jpg, blue.jpg, green.jpg; 129.90 ' => 'fx Bluse; red.jpg, blue.jpg, green.jpg; 129.90 ',
    'Enable this option to keep your imported items’ ID number as is. Otherwise, PrestaShop will ignore them and create auto-incremented ID numbers.' => 'Aktiver denne indstilling for at beholde dine importerede elementers ID nummer som det er. Ellers vil PrestaShop ignore dem og oprette auto-øgede ID numre.',
    'Receive an email when the import is complete. It can be useful when handling large files, as the import may take some time.' => 'Modtag en e-mail når importen er færdig. Dette kan være anvendeligt når der håndteres store filer, da importen kan tage noget tid.',
    'Click on "None" to disable log alerts by email or enter the recipients of these emails in the following field.' => 'Klik på "Ingen" for at deaktivere advarsler via e-mail eller angiv modtagere af disse e-mails i det følgende felt.',
    'Log alerts will be sent to these emails. Please use a comma to separate them (e.g. pub@prestashop.com, anonymous@psgdpr.com).' => 'Log advarsler vil blive sendt til disse e-mails. Anvend venligst et komma for at separere dem (fx pub@prestashop.com, anonymous@psgdpr.com).',
    'Before activating the webservice, you must be sure to: ' => 'Inden du aktiverer webservicen, så skal du være sikker på at: ',
    'Check that URL rewriting is available on this server.' => 'Kontroller om URL omskrivning er tilgængelig på denne server.',
    'Check that the five methods GET, POST, PUT, DELETE and HEAD are supported by this server.' => 'Kontrollere, at de fem metoder, GET; POST, PUT, DELETE og HEAD, er understøttet af denne server.',
    'Before choosing "Yes", check that PHP is not configured as an Apache module on your server.' => 'Inden du vælger "Ja", skal du tjekke, at PHP ikke er konfigureret som et Apache-modul på serveren.',
    'Quick description of the key: who it is for, what permissions it has, etc.' => 'Hurtig beskrivelse af nøglen: Hvem er den til, hvilke tilladelser indeholder den osv.',
    'Informative only' => 'Blot til information',
    'Warning' => 'Advarsel',
    'Error' => 'Fejl',
    'Major issue (crash)!' => 'Stort problem (nedbrud)!',
    'How to restore a database backup in 10 easy steps' => 'Sådan gendanner du en database backup med 10 nemme trin',
    'Set "Enable Shop" to "No" in the "Maintenance" page under the "Preferences" menu.' => 'Sæt "Aktiver butik" til "Nej" under Indstillinger > Vedligeholdelse i menuen.',
    'Download the backup from the list below or from your FTP server (in the folder "admin/backups").' => 'Download backupfilen fra listen herunder, eller fra din FTP server (i mappen "admin/backups").',
    'Check the backup integrity: Look for errors, incomplete file, etc... Be sure to verify all of your data.' => 'Kontroller integriteten af backuppen. Kig efter fejl, for ufuldstændig fil o.s.v. Kontroller alle dine data.',
    'Please ask your hosting provider for "phpMyAdmin" access to your database.' => 'Spørg din værtsudbyder for ʺphpMyAdminʺ adgang til din database.',
    'Connect to "phpMyAdmin" and select your current database.' => 'Brug adgangen til "phpMyAdmin", og vælg din aktuelle database.',
    'Unless you enabled the "Drop existing tables" option, you must delete all tables from your current database.' => 'Medmindre du har valgt "Drop eksisterende tabeller", skal du slette alle tabeller i din aktuelle database.',
    'At the top of the screen, please select the "Import" tab' => 'Vælg fanen "Import" øverst i skærmbilledet',
    'Click on the "Browse" button and select the backup file from your hard drive.' => 'Klik på "Browse" knappen og vælg backupfilen fra din harddisk.',
    'Check the maximum filesize allowed (e.g. Max: 16MB)' => 'Kontroller den maksimale tilladte filstørrelse (f.eks. maks.: 16 MB)',
    'If your backup file exceeds this limit, contact your hosting provider for assistance. ' => 'Hvis din backup fil er større end tilladt, skal du kontakte din serverudbyder. ',
    'Click on the "Go" button and please wait patiently for the import process to conclude. This may take several minutes.' => 'Klik på knappen "Go" og vent på gennemførelsen af importen. Dette kan vare adskillige minutter.',
    'Click on the "%phpmyadmin_browse_label%" button and select the backup file from your hard drive.' => 'Klik på knappen "%phpmyadmin_browse_label%" og vælg backupfilen fra din harddisk.',
    'Click on the "%phpmyadmin_go_label%" button and please wait patiently for the import process to conclude. This may take several minutes.' => 'Klik på knappen "%phpmyadmin_go_label%", og vær venligst tålmodig, mens importprocessen gennemføres. Dette kan tage adskillige minutter.',
    'If enabled, the backup script will drop your tables prior to restoring data.' => 'Hvis aktiveret, opnår du at dine tabeller bliver droppet, før din backup bliver genindlæst.',
    '(ie. "DROP TABLE IF EXISTS")' => '(f.eks. "DROP TABLE IF EXISTS")',
    'You can read information on import at:' => 'Du kan læse oplysninger om import på:',
    'http://doc.prestashop.com/display/PS17/Import' => 'http://doc.prestashop.com/display/PS17/Import',
    'https://en.wikipedia.org/wiki/Comma-separated_values' => 'https://en.wikipedia.org/wiki/Comma-separated_values',
    'Allowed formats: .csv, .xls, .xlsx, .xlst, .ods, .ots' => 'Tilladte formater: .csv, .xls, .xlsx, .xlst, .ods, .ots',
    'Only UTF-8 and ISO 8859-1 encodings are allowed' => 'Kun UTF-8 eller ISO 8859-1 indkodede filer er tilladte',
    'You can also upload your file via FTP to the following directory: %s .' => 'Du kan også uploade din fil via FTP til den følgende mappe: %s.',
    'e.g. ' => 'f.eks.',
    'If you enable this option, your imported items\' ID number will be used as is. If you do not enable this option, the imported ID numbers will be ignored, and PrestaShop will instead create auto-incremented ID numbers for all the imported items.' => 'Hvis du aktiverer denne indstilling, vil de importerede varers id-numre blive benyttet, som de er. Hvis du ikke aktiverer indstillingen, ignoreres de importerede varers id-numre, og PrestaShop opretter i stedet for automatisk stigende id-numre for alle importerede varer.',
    'Sends an email to let you know your import is complete. It can be useful when handling large files, as the import may take some time.' => 'Sender en e-mail for at give dig besked om, at importen er fuldført. Det kan være nyttigt ved håndtering af store filer, da importen eventuelt kan tage noget tid.',
    'Read more about the CSV format at:' => 'Læs mere om CSV-formatet på:',
