    'Your avatar in PrestaShop 1.7.x is your profile picture on %url%. To change your avatar, log in to PrestaShop.com with your email %email% and follow the on-screen instructions.' => 'Din avatar i PrestaShop 1.7.x er dit profilbillede på %url%. For at ændre din avatar skal du logge på PrestaShop.com med din e-mailadresse %email% og følge vejledningen på skærmen.',
    'Password should be at least %num% characters long.' => 'Adgangskoden skal være mindst %num% tegn.',
