    'Fill in the fields and click "Save".' => 'Udfyld felterne og klik på "Gem".',
    'You can then view the query results by clicking on the Edit action in the dropdown menu' => 'Du kan derefter se søgeresultatet ved at klikke på Edit/Ret aktionen i Dropdown menuen',
