    'Set the amount of hours during which the back office cookies are valid. After that amount of time, the PrestaShop user will have to log in again.' => 'Angiv hvor mange timer cookies er gyldige i back-office. Efter dette tidsrum, er PrestaShop-brugeren nødt til at logge ind igen.',
    'Set the maximum size allowed for attachment files (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'Angiv den maksimale størrelse for vedhæftede filer (i megabytes). Denne værdi må ikke overstige den maksimalt tilladte størrelse for upload på din server (aktuelt: %size% MB).',
    'Notifications are numbered bubbles displayed at the very top of your back office, right next to the shop\'s name. They display the number of new items since you last clicked on them.' => 'Beskeder er nummererede bobbeltekster, der bliver vist i toppen af bagkontoret lige til venstre for webshoppens navn. Boblerne viser antallet af nye beskeder siden du sidst klikkede på dem.',
