    'This page benefits from increased performance and includes new features such as a new combination management system. Please note this is a work in progress and some features are not available yet.' => 'Denne side drager fordel af øget performance og inkluderer nye funktionaliteter såsom et nyt kombinationsstyringssystem. Læg venligst mærke til at dette er igangværende arbejde og nogle funktionaliteter er endnu ikke tilgængelige.',
