    'To add "tags," click in the field, write something, and then press "Enter."' => 'For at tilføje "tags", klik i feltet, skriv noget, og tast derefter "Enter."',
    'Allow customers to upload files using the contact page.' => 'Tillad kunder at uploade filer via kontaktside.',
    'Please fill out the message fields that appear by default when you answer a thread on the customer service page.' => 'Udfyld venligst den besked, der vises som standard, når du besvarer en tråd på kundeservicesiden.',
    'URL for your IMAP server (ie.: mail.server.com).' => 'URL for IMAP server (f.eks.: mail.server.dk).',
    'Port to use to connect to your IMAP server.' => 'Port der skal anvendes til din IMAP server.',
    'User to use to connect to your IMAP server.' => 'Bruger der skal anvendes til at forbinde til din IMAP server.',
    'Password to use to connect your IMAP server.' => 'Adgangskode der skal anvendes til at forbinde til din IMAP server.',
    'Delete messages after synchronization. If you do not enable this option, the synchronization will take more time.' => 'Slet beskeder efter synkronisering. Hvis du ikke aktiverer denne indstilling, så vil synkroniseringen tage længere tid.',
    'Create new threads for unrecognized emails.' => 'Opret nye tråde for ukendte e-mails.',
    'Use POP3 instead of IMAP.' => 'Brug POP3 i stedet for IMAP.',
    'Do not use RSH or SSH to establish a preauthenticated IMAP sessions.' => 'Brug ikke RSH eller SSH til at etablere en preauthenticated IMAP session.',
    'Use the Secure Socket Layer (TLS/SSL) to encrypt the session.' => 'Anvend Secure Socket Layer (TLS/SSL) for at kryptere sessionen.',
    'Validate certificates from the TLS/SSL server.' => 'Godkend certifikater fra TLS/SSL server.',
    'Do not validate certificates from the TLS/SSL server. This is only needed if a server uses self-signed certificates.' => 'Godkend ikke certifikater fra TLS/SSL server. Dette er kun nødvendigt, hvis serveren bruger selvsignerede certifikater.',
    'Force use of start-TLS to encrypt the session, and reject connection to servers that do not support it.' => 'Fremtving brug af start-TLS til at kryptere sessionen, og afvis forbindelse til servere, der ikke understøtter det.',
    'Do not use start-TLS to encrypt the session, even with servers that support it.' => 'Brug ikke start-TLS til at kryptere sessionen, end ikke med servere, der understøtter det.',
    'Add new feature value' => 'Tilføj ny egenskabsværdi',
    'Save and add another value' => 'Gem og tilføj en anden værdi',
    'Back to the list' => 'Tilbage til liste',
    'Add new feature values' => 'Tilføj nye egenskabsværdier',
    'To add "tags," click inside the field, write something, and then press "Enter."' => 'For at tilføje "tags", klik i feltet, skriv noget, og tast derefter "Enter."',
    'Company name for this brand' => 'Firmanavn for dette brand',
    'Company name for this supplier' => 'Firmanavn for leverandøren',
    'To add "tags" click in the field, write something and then press "Enter".' => 'For at tilføje "tags", klik i feltet, skriv noget, og tast derefter "Enter".',
    'Phone number for this supplier' => 'Leverandørens telefonnummer',
    'Mobile phone number for this supplier.' => 'Telefonnummer til leverandøren.',
    'Create a new product: CTRL+P' => 'Opret et nyt produkt: CTRL+P',
    'To have a different title from the category name, enter it here.' => 'For at have en anden titel en kategorinavnet, angiv den her.',
    'To have a different description than your category summary in search results page, write it here.' => 'For at have en anden beskrivelse end dit kategorisammendrag på søgeresultatsiden, så skriv den her.',
    'Unless the \'Accented URL\' option is enabled (in Shop parameters > Traffic & SEO), only letters, numbers, underscores (_), and hyphens (-) are allowed.' => 'Med mindre indstillingen \'Accented URL\' er aktiveret (under Butiksparametre > Traffik & SEO), kun bogstaver, tal, underscores (_), og bindestreger (-) er tilladte.',
    'Search for a product' => 'Søg en vare',
    'Enter your product name' => 'Indtast dit varenavn',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'Resuméet er en kort sætning, der beskriver din vare.<br />Det vil forekomme øverst på din butiks vareside, på produktlister og på søgemaskiners resultatside (så det er vigtigt for SEO). Brug fanen "Beskrivelse" for at komme med flere oplysninger om din vare.',
    'Search and add a related product' => 'Søg og tilføj en relateret vare',
    'Use a comma to create separate tags. E.g.: dress, cotton, party dresses.' => 'Brug et komma til at oprette separate tags. F.eks.: kjole, bomuld, festkjoler.',
    'Per kilo, per litre' => 'Pr. kilo, pr. litter',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Kombiner flere egenskaber, f.eks.: "Størrelse: all", "Farve: rød".',
    'Leave empty to disable' => 'Efterlad tom for at deaktivere',
    'To have a different title from the product name, enter it here.' => 'For at få en anden titel end varenavnet indtastes den her.',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Offentlig titel til varens side og til søgemaskiner. Efterlad tom for at bruge varenavnet. Antallet af resterende tegn vises til venstre for feltet.',
    'To have a different description than your product summary in search results pages, write it here.' => 'For at få en anden beskrivelse end dit produktresumé på søgeresultatssider skrives den her.',
    'This description will appear in search engines. You need a single sentence, shorter than 160 characters (including spaces)' => 'Denne beskrivelse vises i søgemaskiner. Du skal have en enkelt sætning på mindre end 160 tegn (inkl. mellemrum)',
    'To which product the page should redirect?' => 'Hvilken vare skal siden omdirigere til?',
    'To which category the page should redirect?' => 'Hvilken kategori skal siden omdirigere til?',
    'If no category is selected the Main Category is used' => 'Hvis ingen kategori er valgt, så anvendes hovedkategorien',
    'Upload a brand logo from your computer.' => 'Upload et mærkelogo fra din computer.',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.). A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Hvis du ønsker at oprette en kategori hurtigt, så kan du gøre det her. Glem ikke at gå til siden Kategorier for at udfylde de behøvede detaljer (beskrivelse, billede, etc.). En ny kategori vil ikke automatisk vises i din butiks menu, læs venligst Hjælpen om dette.',
    'This interface allows you to specify the suppliers of the current combination.' => 'Dette interface giver dig mulighed for at angive leverandørerne af den aktuelle kombination.',
    'Using another image as cover will automatically uncheck this box.' => 'Anvendelse af et andet billede som cover vil automatisk fjerne markeringen af denne boks.',
    'This is the net sales price for your customers. The retail price (tax incl.) will automatically be calculated using the selected tax rate.' => 'Dette er netto salgsprisen for dine kunder. Udsalgsprisen (incl. moms) vil automatisk blive beregnet ved anvendelse af den valgte momssats.',
    'Indicate the price for a single unit of the product. For instance, if you\'re selling fabrics, it would be the price per meter.' => 'Angiv prisen for en enkelt enhed af produktet. For eksempel, hvis du sælger stof, vil det være prisen per meter.',
    'This description will appear in search engines. It should be a single sentence, shorter than 160 characters (including spaces).' => 'Denne beskrivelse vil fremkomme i søgemaskiner. Det bør være en enkelt sætning, mindre end 160 karakterer (inklusiv mellemrum).',
    'Public title for the product page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the right of the field.' => 'Offentlig titel for produktsiden, og til søgemaskiner. Efterlad tom for at anvende produktnavnet. Antallet af tilbageværende karakterer  bliver vist til højre for feltet.',
    'Will appear in the list of suppliers.' => 'Vil blive vist i listen over leverandører.',
    'Upload a supplier logo from your computer.' => 'Upload et leverandør logo fra din computer.',
    'Only letters and the minus (-) character are allowed.' => 'Kun bogstaver og minus (-) tegnet er tilladt.',
    'Search name' => 'Søgenavn',
    'Search ref.' => 'Søgeref.',
    'Search category' => 'Søgekategori',
    'Permanently delete this product.' => 'Slet denne vare for bestandigt.',
    'See how your product sheet will look online: ALT+SHIFT+V' => 'Se, hvordan produktsiden vises online: ALT+SHIFT+V',
    'Enable or disable the product on your shop: ALT+SHIFT+O' => 'Aktivér eller deaktivér produktet i din butik: ALT+SHIFT+O',
    'Save the product and stay on the current page: ALT+SHIFT+S' => 'Gem denne vare, og bliv på den aktuelle side: ALT+SHIFT+S',
    'Save and duplicate this product, then go to the new product: ALT+SHIFT+D' => 'Gem og dupliker denne vare, og gå derefter til den nye vare: ALT+SHIFT+D',
    'Save and go back to the catalog: ALT+SHIFT+Q' => 'Gem, og gå tilbage til kataloget: ALT+SHIFT+Q',
    'Save and create a new product: ALT+SHIFT+P' => 'Gem, og opret en ny vare: ALT+SHIFT+P',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'Er varene en pakke (en kombination med mindst to eksisterende varer), en virtuel vare (fil, der kan downloades, service osv.) eller blot en almindelig, fysisk vare?',
    'Where should the product be available on your site? The main category is where the product appears by default: this is the category which is seen in the product page\'s URL. Disabled categories are written in italics.' => 'Hvor skal varen være tilgængelig på dit websted? Hovedkategorien er der, hvor varen vises som standard: det er den kategori, som ses på varens URL. Deaktiverede kategorier står med kursiv.',
    'Search categories' => 'Søgekategorier',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.).  A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Hvis du hurtigt vil oprette en ny kategori, kan du gøre det her. Husk at gå til kategorisiden for at udfylde de nødvendige detaljer (beskrivelse, billede osv.). En ny kategori vises ikke automatisk i butikkens menu, men du kan læse om det i hjælpen.',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Har denne kombination en anden pris? Er den billigere eller dyrere end standard butiksprisen?',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'Kombinationer er de forskellige variationer af en vare, hvor egenskaber såsom dens størrelse, vægt eller farve har forskellige værdier. For at oprette en kombination skal du først oprette dine produktegenskaber. Gå til Katalog > Attributter og egenskaber for dette!',
    'To add combinations, you first need to create proper attributes and values in [1]Attributes & Features[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "Generate": it will automatically create all the combinations for you!' => 'For at tilføje varianter skal du først oprette de relevante attributter og værdier under [1]Attributter og egenskaber[/1]. <br> Når du er færdig, kan du indtaste de ønskede attributter (som "størrelse" eller "farve") med de respektive værdier ("XS", "Rød", "Alle" osv.) i feltet nedenfor. Du kan også vælge dem i højre kolonne. Klik herefter på "Generer". Derved oprettes alle varianter automatisk!',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1]. <br> When done, you may enter the wanted attributes (like "size" or "color") and their respective values ("XS", "red", "all", etc.) in the field below; or simply select them from the right column. Then click on "%generate_label%": it will automatically create all the combinations for you!' => 'For at tilføje kombinationer, så skal du først oprette attributter og værdier under [1]%attributes_and_features_label%[/1]. <br> Når det er gjort, så kan du angive de ønskede attributter (såsom "størrelse" eller "farve") og deres respektive værdier ("XS", "red", "alle", etc.) i feltet nedenunder; eller blot vælge dem fra den højre kolonne. Klik derefter på "%generate_label%": dette vil automatisk oprette alle kombinationer for dig!',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'Dette er den URL-adresse, som er genereret ud fra varens navn, og som kan ses i browseren. Du kan ændre den, hvis du vil.',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page by typing the product or category name.' => 'Når en vare er deaktiveret, skal du vælge, hvilken side du vil omdirigere kunderne til, når de besøge denne side.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Ingen omdirigering (404) = Omdiriger ikke til nogen steder, og vis en 404 "Ikke fundet"-side.',
    'Permanent redirection (301) = Permanently display another product or category instead.' => 'Permanent omdirigering (301) = Vis altid en anden vare eller kategori i stedet for.',
    'Temporary redirection (302) = Temporarily display another product or category instead.' => 'Midlertidig omdirigering (302) = Vis midlertidigt en anden vare eller kategori i stedet for.',
    'Display delivery time for a product is advised for merchants selling in Europe to comply with the local laws.' => 'Det anbefales at vise leveringstid for et produkt, for webshops der sælger i Europa, for at overholde lokal lovgivning.',
    'edit' => 'rediger',
    'If a carrier has a tax, it will be added to the shipping fees. Does not apply to free shipping.' => 'Hvis en leverandør pålægger moms, så vil det blive tilføjet til leverandøromkostningerne. Gælder ikke for gratis forsendelse.',
    'This interface allows you to specify the suppliers of the current product and its combinations, if any.' => 'Denne grænseflade lader dig specificere den aktuelle vares leverandører og dens kombinationer, hvis relevant.',
    'You can specify supplier references according to previously associated suppliers.' => 'Du kan angive leverandørreferencer i henhold til tidligere tilknyttede leverandører.',
    'When using the advanced stock management tool (see Shop Parameters > Products settings), the values you define (price, references) will be used in supply orders.' => 'Når der anvendes et avanceret lagerstyringsværktøj (se Butiksparametre > Vareindstillinger), bliver de værdier, du definerer (pris, referencer) anvendt i leverandørordrer.',
    'You can specify product reference(s) for each associated supplier. Click "Save" after changing selected suppliers to display the associated product references.' => 'Du kan angive produktreference(r) for hver tilknyttet leverandør. Klik på "Gem" efter at have ændret de valgte leverandører for at vise de tilknyttede produktreferencer.',
    'You can specify product reference(s) for each associated supplier. Click "%save_label%" after changing selected suppliers to display the associated product references.' => 'Du kan angive produktreference(r) for hver tilknyttet leverandør. Klik på "%save_label%" efter at have ændret de valgte leverandører for at vise de tilknyttede produktreferencer.',
    'This interface allows you to specify the warehouse in which the product is stocked.' => 'Denne grænseflade gør, at du kan angive i hvilket af lagerstederne varen lagerføres.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Det er også muligt at angive lokationen inden for lagerbygningen for hvert produkt eller hver kombination.',
    'Number of days this file can be accessed by customers. Set to zero for unlimited access.' => 'Antal dage, hvor denne fil kan tilgås af kunder. Sæt til 0 for ubegrænset adgang.',
    'Upload a file from your computer (%maxUploadSize% max.)' => 'Upload en fil fra din computer (maks. %maxUploadSize%)',
    'The full filename with its extension (e.g. Book.pdf)' => 'Hele filnavnet inklusiv filtypenavnet (f.eks. bog.pdf)',
    'Number of downloads allowed per customer. Set to 0 for unlimited downloads.' => 'Antal tilladte downloads. Sæt til 0 for ubegrænset download.',
    'If set, the file will not be downloadable after this date. Leave blank if you do not wish to attach an expiration date.' => 'Hvis angivet, vil filen ikke længere kunne downloades efter denne dato. Lad dette felt være blank for ingen udløbsdato.',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Minimumsmængden, der er nødvendig for at købe denne vare (sæt til 1 for at deaktivere denne egenskab). F.eks.: hvis sat til 3 vil kunder kun kunne varen, hvis de tager en mængde på mindst 3.',
    'The email will be sent to all the users who have the right to run the stock page. To modify the permissions, go to [1]Advanced Parameters > Team[/1]' => 'Denne e-mail vil blive sendt til alle brugere, som har rettigheder til at vise lager-siden. For at ændre disse rettigheder, gå til [1]Advanced Parameters > Team[/1]',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'Kombinationer er forskellige variationer af en vare, hvor egenskaber såsom dens størrelse, vægt eller farve har forskellige værdier. Kræver din vare kombinationer?',
    'Advanced settings in [1][2]Combinations[/1]' => 'Avancerede indstillinger i [1][2]Kombinationer[/1]',
    'Your reference code for this product. Allowed special characters: .-_#.' => 'Din referencekode til denne vare. Tilladte specialtegn: .-_#.',
    'How many products should be available for sale?' => 'Hvor mange varer skal være disponible til salg?',
    'Advanced settings in [1][2]Quantities[/1]' => 'Avancerede indstillinger i [1][2]Mængder[/1]',
    'This is the retail price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Dette er den butikspris, som du påtænker at sælge denne vare til dine kunder til. Momsen, der er inkluderet i prisen, vil ændre sig alt efter den momsregel, du vælger.',
    'Advanced settings in [1][2]Pricing[/1]' => 'Avancerede indstillinger i [1][2]Prissætning[/1]',
    'Tags are meant to help your customers find your products via the search bar.' => 'Tags har til hensigt at hjælpe dine kunder med at finde dine vare via søgelinjen.',
    'Choose terms and keywords that your customers will use to search for this product and make sure you are consistent with the tags you may have already used.' => 'Vælg udtryk og nøgleord, som din kunder vil bruge til at søge efter denne vare, og sørg for, at du er konsekvent med de tags, du eventuelt allerede har brugt.',
    'You can manage tag aliases in the [1]Search section[/1]. If you add new tags, you have to rebuild the index.' => 'Du kan håndtere tagalias i [1]Search section[/1]. Hvis du tilføjer nye tags, skal du opdatere indekset.',
    'Not all shops sell new products. This option enables you to indicate the condition of the product. It can be required on some marketplaces.' => 'Ikke alle butikker sælger nye varer. Denne valgmulighed gør dig i stand til at angive varens tilstand. Det kan være påkrævet på nogle markeder.',
    'ISBN is used internationally to identify books and their various editions.' => 'ISBN bruges internationalt til at identificere bøger og deres forskellige udgaver.',
    'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.' => 'Denne type produktkode er almindeligt anvendt i Usa, Canada, Storbritannien, Australien, New Zealand og andre lande.',
    'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.' => 'Denne type produktkode er specifik for Europa og Japan, men er almindeligt anvendt globalt. Det er ligesom UPC-koden. Alle varer mærket med en EAN-kode bliver også accepteret i Nordamerika.',
    'MPN is used internationally to identify the Manufacturer Part Number.' => 'VARENR bliver brugt internt til at identificere producent varenr.',
    'This is the price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Dette er den pris, som du påtænker at sælge denne vare til dine kunder til. Momsen, der er inkluderet i prisen, vil ændre sig alt efter den momsregel, du vælger.',
    'Some products can be purchased by unit (per bottle, per pound, etc.),  and this is the price for one unit. For instance, if you’re selling fabrics, it would be the price per meter.' => 'Nogle varer kan købes pr. enhed (pr. flaske, pr. pund osv.), og det er prisen for én enhed. Hvis du for eksempel sælger stof, vil det være prisen pr. meter.',
    'The cost price is the price you paid for the product. Do not include the tax. It should be lower than the retail price: the difference between the two will be your margin.' => 'Fremstillingsprisen er den pris, du betalte for varen. Moms skal ikke inkluderes. Den skal være lavere end butiskprisen: forskellen mellem de to vil være din margin.',
    'You can set specific prices for customers belonging to different groups, different countries, etc.' => 'Du kan sætte specifikke priser for kunder, der tilhører forskellige grupper, forskellige lande osv.',
    'Sometimes one customer can fit into multiple price rules. Priorities allow you to define which rules apply first.' => 'Nogle gange kan én kunde passe ind under flere prisregler. Prioriteter lader dig definere, hvilke regler der skal gælde først.',
    'Invalid token' => 'Ugyldig token',
    '[1]Invalid token[/1]: direct access to this link may lead to a potential security breach.' => '[1]Ugyldig token[/1]: direkte adgang til dette link kan eventuelt medføre en sikkerhedsbrist.',
    'Do you want to display this page?' => 'Vil du vise denne side?',
    'Yes, I understand the risks' => 'Ja, jeg forstår risiciene',
    'Take me out of there!' => 'Få mig væk herfra!',
    'Click on "Displayed" to index the category on your shop.' => 'Klik på "Vist" for at indeksere kategorien i din butik.',
    'This is the main image for your category, displayed in the category page. The category description will overlap this image and appear in its top-left corner.' => 'Dette er hovedbilledet for din kategori, og det bliver vist på kategorisiden. Kategoribeskrivelsen overlapper billedet og bliver vist i øverste venstre hjørne.',
    'Displays a small image in the parent category\'s page, if the theme allows it.' => 'Viser et lille billede på den overordnede kategoriside, hvis temaet tillader det.',
    'The category thumbnail appears in the menu as a small image representing the category, if the theme allows it.' => 'Kategoriens miniature vises i menuen som et lille billede, der afspejler kategorien, hvis temaet tillader det.',
    'Only letters, numbers, underscore (_) and the minus (-) character are allowed.' => 'Kun bogstaver, tal, understregning (_) og minus (-) er tilladte tegn.',
    'You now have three default customer groups.' => 'Du har nu tre standard kundegrupper.',
    'Mark all of the customer groups which you would like to have access to this category.' => 'Marker alle de kundegrupper som du ønsker skal have adgang til denne kategori.',
    'If you want a category to appear in the menu of your shop, go to [1]Modules > Module Manager[/1] and configure your menu module.' => 'Hvis du ønsker at en kategori skal vises i menuen på din shop, gå til [1]Moduler > Modul manager[/1] og konfigurer dit menumodul.',
    'Click on "%displayed_label%" to index the category on your shop.' => 'Klik på "%displayed_label%" for at indeksere kategorien i din butik.',
    'To add "tags", click inside the field, write something, and then press "Enter".' => 'For at tilføje "tags", klik inden i feltet, skriv noget og tryk så på "Enter".',
    'An empty category is a category that has no product directly associated to it. An empty category may however contain products through its subcategories.' => 'En tom kategori har ingen varer direkte tilknyttet. En tom kategori kan dog indeholde varer via dens underkategorier.',
    'To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1].' => 'For at tilføje kombinationer, skal du først oprette passende attributter og værdier under [1]%attributes_and_features_label%[/1].',
    'To specify the suppliers of this product\'s combinations you can go to [1]{combinations_label}[/1] tab.' => 'For at angive leverandøren af dette produkts kombinationer, så kan du gå til faben [1]{combinations_label}[/1].',
  ),
  'AdminCatalogNotification' => 
  array (
    'You must select some products before' => 'Du skal vælge nogle varer før',
    'Deleting multiple categories' => 'Slet flere kategorier',
    'Deleting this category will remove products linked only within this category and no others. Are you sure you want to continue?' => 'Hvis du sletter denne kategori, fjernes varer kun knyttet til denne kategori, og ingen andre. Er du sikker på du vil fortsætte?',
    'You cannot set a negative position, the minimum for a position is 0.' => 'Du kan ikke sætte en negativ position. Minimum for position er 0.',
