    'Choose a variable fee for each order placed with a foreign currency with %module%. It will be applied on the total paid with taxes.' => 'Vælg et variabelt gebyr til hver ordre, der er afgivet i en udenlandsk valuta med %module%. Det vil blive pålagt det betalte totalbeløb med moms.',
    'For the carrier named %s, indicate the domestic delivery costs  in percentage of the price charged to customers.' => 'Ved anvendelse af %s, opgiv regionale leveringsomkostninger i procent i forhold til kundens opkrævede pris.',
    'For the carrier named %s, indicate the overseas delivery costs in percentage of the price charged to customers.' => 'Ved anvendelse af %s, opgiv udenrigs leveringsomkostninger i procent i forhold til kundens opkrævede pris.',
    'Method: Indicate the percentage of your carrier margin. For example, if you charge $10 of shipping fees to your customer for each shipment, but you really pay $4 to this carrier, then you should indicate "40" in the percentage field.' => 'Anvendelse: Indtast procentdel af leveringsomkostninger. Hvis du f. eks. opkræver 10 kr. i fragt over for din kunde, men reelt kun betaler 4 kr. skal du indtaste "40" i feltet procent.',
    'You should calculate this percentage as follows: ((total sales revenue) - (cost of goods sold)) / (total sales revenue) * 100. This value is only used to calculate the Dashboard approximate gross margin, if you do not specify the wholesale price for each product.' => 'Du skal beregne denne procentsats som følger: ((total salgsindtægt) - (omkostning for solgte varer)) / (total salgsindtægt) * 100. Denne værdi bliver kun anvendt for at beregne cirka engrosmargin på opslagstavlen, hvis du ikke angiver engrosprisen for hver vare.',
    'You should calculate this value by making the sum of all of your additional costs per order.' => 'Du bør udregne denne værdi ved at lægge alle udgifterne sammen pr. ordre.',
  ),
