  'AdminDesignHelp' => 
  array (
    'By default, all images settings are already installed in your store. Do not delete them, you will need it!' => 'Som standard, vil alle billedindstillinger allerede være installeret i din butik. Slet dem ikke, da du vil få brug for dem!',
    'Regenerates thumbnails for all existing images' => 'Regenererer miniaturebilleder for alle eksisterende varebilleder',
    'Please be patient. This can take several minutes.' => 'Vær venligst tålmodig, da dette kan tage flere minutter.',
    'Be careful! Manually uploaded thumbnails will be erased and replaced by automatically generated thumbnails.' => 'Forsigtig! Manuelt uploadede miniaturebilleder vil blive erstattet af automatiske genererede miniaturebilleder. ',
    'Select "No" only if your server timed out and you need to resume the regeneration.' => 'Vælg kun "Nej", hvis serveren fik timeout, og du skal genoptage gendannelsen.',
    'Please select a module' => 'Vælg et modul',
    'Select a module above before choosing from available hooks' => 'Vælg et modul ovenfor, inden du vælger fra tilgængelige kroge',
    'Please specify the files for which you do not want the module to be displayed.' => 'Angiv venligst de filer, til hvilke du ikke ønsker modulet vist.',
    'Please input each filename, separated by a comma (",").' => 'Angiv alle filnavne, adskilt med et komma (",").',
    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'Du kan også klikke på filnavnet på listen nedenfor og vælge flere filnavne samtidig ved at holde Ctrl-tasten nede, mens du klikker, eller vælge en hel række filnavne ved at holde Shift-tasten nede, mens du klikker.',
    'To add "tags" click in the field, write something, and then press "Enter."' => 'For at tilføje "tags", klik i feltet, skriv noget, og tast derefter "Enter"',
    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'JPEG billeder har en lille filstørrelse og standard kvalitet. PNG billeder har en større filstørrelse, en højere kvalitet og understøtter transparent. Bemærk at under alle omstændigheder vil billedfilerne have filtypenavnet .jpg.',
    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'ADVARSEL: Denne funktion er måske ikke forenelig med dit tema eller med nogle moduler. Navnlig er PNG tilstand ikke kompatibel med modulet vandmærke. Hvis du støder på problemer, skal du slå den fra ved at vælge ʺBrug JPEGʺ.',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Spænder fra 0 (dårligste kvalitet, mindste fil) til 100 (bedste kvalitet, største fil).',
    'Recommended: 90.' => 'Anbefalet: 90.',
    'PNG compression is lossless: unlike JPG, you do not lose image quality with a high compression ratio. However, photographs will compress very badly.' => 'PNG komprimering er tabsfri: modsat JPG mister du ikke kvalitet ved en høj komprimering. Fotografier komprimeres dog dårligt.',
    'Ranges from 0 (biggest file) to 9 (smallest file, slowest decompression).' => 'Fra 0 (største fil) til 9 (mindste fil, langsomste komprimering).',
    'Recommended: 7.' => 'Bedste kvalitet; 7.',
    'The maximum file size of pictures that customers can upload to customize a product (in bytes).' => 'Den maksimale filstørrelse for billeder som kunder kan uploade for at brugertilpasse en vare (i bytes).',
    'Width of product customization pictures that customers can upload (in pixels).' => 'Bredde på brugerdefinerede varebilleder som kunder kan uploade (i pixels).',
    'Height of product customization pictures that customers can upload (in pixels).' => 'Højde på brugerdefinerede varebillede som kunder kan uploade (i pixels).',
    'This will generate an additional file for each image (thus doubling your total amount of images). Resolution of these images will be twice higher.' => 'Dette vil generere en yderligere fil for hvert billede (altså vil det fordoble dit totale antal af billeder). Opløsning af disse billede vil være dobbelt så stor.',
    'Enable to optimize the display of your images on high pixel density screens.' => 'Aktiver for at optimere visningen af dine billeder på højopløsnings skærme.',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => 'Dette bør indstilles til "Ja", medmindre du succesfuldt har flyttet billeder i "Billeder" siden under "Præferencer" i menuen.',
    'Letters, underscores and hyphens only (e.g. "small_custom", "cart_medium", "large", "thickbox_extra-large").' => 'Bogstaver, understregning og bindesteger kan bruges (e.g. "small_custom", "cart_medium", "large", "thickbox_extra-large").',
    'Maximum image width in pixels.' => 'Max billedstørrelse i bredden i pixels.',
    'Maximum image height in pixels.' => 'Max billedstørrelse i højden i pixels.',
    'This type will be used for Product images.' => 'Denne type vil blive brugt for produktbillederne.',
    'This type will be used for Category images.' => 'Denne type vil blive brugt for kategoribillederne.',
    'This type will be used for Brand images.' => 'Denne type vil blive anvendt til mærkebilleder.',
    'This type will be used for Supplier images.' => 'Denne type vil blive anvendt til leverandørbilleder.',
    'This type will be used for Store images.' => 'Denne type vil blive anvendt til butiksbilleder.',
    'E.g. address, addresses, attachment' => 'Fx adresse, adresser, vedhjæftning',
    'Will appear on main page. Recommended size for the default theme: height %height% and width %width%.' => 'Vises på hovedsiden. Anbefalet størrelse til standardtema: højde %height% og bredde %width%.',
    'Warning: you can use a PNG file for transparency, but it can take up to 1 second per page for processing. Please consider using JPG instead.' => 'Advarsel: du kan bruge en PNG-fil af hensyn til gennemsigtighed, men det kan tage op til 1 sekund pr. side at behandle den. Du kan overveje at bruge JPG-filer i stedet for.',
    'It is the small icon that appears in browser tabs, next to the web address' => 'Det er et lille ikon, der vises i adresselinjen i browseren',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.\\nOnce you click on "Adapt to RTL", any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Vær forsigtig! Kontroller venligst dit tema på et RTL sprog inden du genererer the RTL stylesheet: dit tema kan allerede være adapteret til RTL.\\nNår du klikker på "Adapter til RTL", så vil enhver RTL-specifik fil som du måske har tilføjet til dit tema måske blive slettet af det oprettede stylesheet.',
    'Used in the h1 page tag, and as the default title tag value.' => 'Anvendt på h1 side tag, og som standard titel tag værdi.',
    'Used to override the title tag value. If left blank, the default title value is used.' => 'Anvendt til at overskrive titel tag værdien. Hvis efterladt tom, så anvendes standard titel værdien.',
    'Browse your computer files and select the Zip file for your new theme.' => 'Gennemse dine filer på computeren, og vælg Zip-filen for dit nye tema.',
    'Indicate the complete URL to an online Zip file that contains your new theme. For instance, "http://example.com/files/theme.zip".' => 'Angiv den komplette URL-adresse til den online zip-fil, der indeholder dit nye tema. For eksempel "http://example.com/files/theme.zip".',
    'This selector lists the Zip files that you uploaded in the \'/themes\' folder.' => 'Denne vælgerfunktion viser de zip-filer, du har uploadet til mappen \'/themes\'.',
    'Create meaningful content' => 'Opret meningsfuldt indhold',
    'Because it is not just selling products but also creating a universe, build pages to tell stories and catch your visitors’ interest, to turn them into loyal customers.' => 'Fordi det ikke kun handler om salg af varer, men om at skabe et univers, bygge sider til at fortælle historier og fange dine kunders interesser, for at konvertere dem til loyale kunder.',
    'Add new page category' => 'Tilføj ny sidekategori',
    'Add new page' => 'Tilføj ny side',
    'This won\'t regenerate email templates, it only sets the default email theme for future generation (when a language is installed for example).' => 'Dette vil ikke regenerere e-mailskabeloner, men kun sætte standard e-mailtemaet for fremtidige genereringer (når der fx installeres et sprog).',
    'PrestaShop\'s email templates are stored in the "mails" folder, but they can be overridden by your current theme\'s own "mails" folder. Using this option enables to overwrite emails from your current theme.' => 'PrestaShops e-mailskabeloner er gemt i mappen "mails", men de kan overskrives af dit aktuelle temas egen "mails" mappe. Ved at anvende denne indstilling, så giver det mulighed for at overskrive e-mails fra dit aktuelle tema.',
    'By default, existing email template files are not modified to avoid deleting any modification you may have done. Enable this option to force the overwrite.' => 'Som standard modificeres eksisterende e-mail skabeloner ikke for at undgå at slette ændringer som du måske har lavet. Aktiver denne indstilling for at gennemtvinge overskrivningen.',
    'No emails were detected in any theme folder so this field is disabled.' => 'Ingen e-mails blev blive fundet i nogen tema mappe, så dette felt er deaktiveret.',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Bliver vist i toppen af e-mails. Hvis der ikke er angivet et logo, bliver hovedlogoet benyttet i stedet.',
    'Warning: if no invoice logo is available, the main logo will be used instead.' => 'Advarsel: Hvis der ikke er et fakturalogo, anvendes det primære logo i stedet for.',
    'Will appear on invoice headers.' => 'Vil blive vist i toppen af fakturaer.',
    'Use our [1]favicon generator on PrestaShop Marketplace[/1] to boost your brand image!' => 'Anvendelse af [1]favicon generator på PrestaShop Marketplace[/1] tïl at booste dit brand!',
    'Will appear on your main page. Recommended size for the default theme: height %height% and width %width%.' => 'Vil vises på din hovedside. Anbefalet størrelse for standard temaet er: højde %height% og bredde %width%.',
    'It is the small icon that appears in browser tabs, next to the title.' => 'Det er det lille ikon som vises i browser faner, ved siden af titlen.',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.
Once you click on "Adapt to RTL", any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Vær forsigtig! Kontroller venligst dit tema med et RTL sprog inden du genererer RTL stylesheetet: dit tema er måske allerede adapteret til RTL.
Når du klikker på "Adapter til RTL", så vil enhver RTL-specifik fil som du har tilføjet til dit tema, måske blive slettet af det oprettede stylesheet.',
    'Be careful! Please check your theme in an RTL language before generating the RTL stylesheet: your theme could be already adapted to RTL.
Once you enable the "%generate_rtl_label%" option, any RTL-specific file that you might have added to your theme might be deleted by the created stylesheet.' => 'Vær forsigtig! Kontroller venligst dit tema med et RTL sprog inden du genererer RTL stylesheetet: dit tema er måske allerede adapteret til RTL.
Når du klikker på "%generate_rtl_label%", så vil enhver RTL-specifik fil som du har tilføjet til dit tema, måske blive slettet af det oprettede stylesheet.',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Du skal vælge en butik fra ovenstående liste, hvis du vil vælge et tema.',
    'You are editing this page for a specific shop or group. Click "Yes" to check all fields, "No" to uncheck all.' => 'Du er ved at redigere denne side til en bestemt butik eller gruppe. Klik på "Ja" for at markere alle felter, eller klik på "Nej" for at fjerne markeringen af alle felter.',
    'If you check a field, change its value, and save, the multistore behavior will not apply to this shop (or group), for this particular parameter.' => 'Hvis du markerer et felt, ændrer dets værdi og gemmer det, vil butikskædefunktionen ikke gælde for denne butik (eller gruppe) for dette bestemte parameter.',
    'You are editing this page for a specific shop or group. Click "%yes_label%" to check all fields, "%no_label%" to uncheck all.' => 'Du er ved at redigere denne side til en bestemt butik eller gruppe. Klik på "%yes_label%" for at markere alle felter, eller klik på "%no_label%" for at fjerne markeringen af alle felter.',
  ),
  'AdminDesignNotification' => 
  array (
    'Your page will be saved as a draft' => 'Siden gemmes som kladde',
    'You can choose to keep your images stored in the previous system. There\'s nothing wrong with that.' => 'Du kan vælge at lade dine billeder gemt lagret i det tidligere system - det er der ikke noget galt i.',
    'You can also decide to move your images to the new storage system. In this case, click on the "Move images" button below. Please be patient. This can take several minutes.' => 'Du kan også beslutte at flytte dine billeder til det nye lagringsssystem: I det tilfælde skal du klikke på ʺFlyt billederʺ knappen nedenfor. Vær venligst tålmodig, dette kan tage adskillige minutter.',
    'After moving all of your product images, set the "Use the legacy image filesystem" option above to "No" for best performance.' => 'Når du har flyttet alle dine varebilleder, opnår du bedste ydeevne ved at angive ʺBrug indstillingen for ældre billedfilsystemʺ ovenfor til ʺNej".',
    'Be careful! Depending on the options selected, former manually uploaded thumbnails might be erased and replaced by automatically generated thumbnails.' => 'Vær forsigtig! Afhængig af de valgte indstillinger, så kan det ske at tidligere manuelt uploadede miniaturer kan blive slettet og erstattet af automatisk genererede miniaturer.',
    'Also, regenerating thumbnails for all existing images can take several minutes, please be patient.' => 'Derudover, så kan regenerering af miniaturer for alle eksisterende billeder tage adskillige minutter. Vær venligst tålmodig.',
    'If you want to order/move the following data, please select a shop from the shop list.' => 'Hvis du ønsker at ændre rækkefølgen/flytte følgende data, vælg da venligst en butik fra butikslisten.',
    'Current theme is unavailable. Please check your theme\'s directory name ("%s") and permissions.' => 'Det aktuelle tema er ikke disponibelt. Kontroller temaets mappenavn ("%s") og tilladelser.',
    'No items found' => 'Intet fundet',
    'Duplicate images were found when moving the product images. This is likely caused by unused demonstration images. Please make sure that the folder %folder% only contains demonstration images, and then delete it.' => 'Dublet billeder blev fundet under flytning af produktbillederne. Dette skyldes højst sandsynligt ubrugte demonstrationsbilleder. Vær venligst sikker på at mappen %folder% kun indeholder demonstrationsbilleder, og slet dem så.',
    'Incorrect value for the selected JPEG image compression.' => 'Ugyldig værdi for den valgte JPEG-kompression.',
    'Incorrect value for the selected PNG image compression.' => 'Ugyldig værdi for den valgte PNG-kompression.',
    'Source file does not exist or is empty (%filepath%)' => 'Kildefilen findes ikke eller er tom (%filepath%)',
    'Failed to resize image file (%filepath%)' => 'Kunne ikke ændre størrelsen på billedfilen (%filepath%)',
    'Failed to resize image file to high resolution (%filepath%)' => 'Kunne ikke ændre størrelsen på billedfilen til høj opløsning (%filepath%)',
    'Original image is corrupt (%filename%) for product ID %id% or bad permission on folder.' => 'Originalt billede er beskadiget (%filename%) for produkt-ID %id% eller dårlig tilladelse for mappe.',
    'Original image is missing or empty (%filename%) for product ID %id%' => 'Originalt billede mangler eller er tomt (%filename%) for produkt-ID %id%',
    'Cannot write images for this type: %1$s. Please check the %2$s folder\'s writing permissions.' => 'Der kan ikke skrives billeder for typen %1$s. Kontroller skriverettighederne for mappen %2$s.',
