    'Format:' => 'Format:',
    'Filesize:' => 'Filstørrelse:',
    'MB max.' => 'MB maks.',
    'Current size:' => 'Aktuel størrelse:',
    'Your online store needs to have a proper carrier registered in PrestaShop as soon as you start shipping your products. This means sending yours parcels using your local postal service, or having a contract with a private carrier which in turn will ship your parcels to your customers. In order to have PrestaShop suggest the most adequate carrier to your customers during their order checkout process, you need to register all the carriers with which you have chosen to work.' => 'Din onlinebutik skal have et leveringsfirma registreret i PrestaShop, så snart du starter med at sende dine varer. Det betyder afsendelse af dine pakker via dit lokale postvæsen eller en kontrakt med et privat leveringsfirma, som sender dine pakker til kunderne. For at PrestaShop kan foreslå det bedst egnede leveringsfirma til dine kunder, når de bestiller, skal du registrere alle de leveringsfirmaer, som du har valgt at arbejde med.',
    'PrestaShop comes with a number of carrier modules that you can activate. You can also buy carrier modules on the PrestaShop Addons marketplace. Recommended modules are listed below: install the module that matches your carrier, and configure it!' => 'PrestaShop indeholder flere moduler med leveringsfirmaer, som du kan aktivere. Du kan også købe moduler med leveringsfirmaer på PrestaShop Addons-markedspladsen. De anbefalede moduler er anført nedenfor: Installer det modul, der svarer til dit leveringsfirma, og konfigurer det!',
    'If there is no existing module for your carrier, then you can register that carrier by hand using the information that it can provide you: shipping rates, regional zones, size and weight limits, etc. Click on the "Add new carrier" button below to open the Carrier Wizard, which will help you register a new carrier in a few steps.' => 'Hvis der ikke er noget eksisterende modul for det valgte leveringsfirma, så kan du registrere leveringsfirmaet manuelt ved hjælp af de oplysninger, som leveringsfirmaet kan give dig: Forsendelsespriser, regionale zoner, størrelses- og vægtgrænser osv. Klik på knappen "Tilføj nyt leveringsfirma" nedenfor for at åbne guiden Leveringsfirma, som vil hjælpe dig med at registrere et nyt leveringsfirma i nogle få trin.',
    'Note: DO NOT register a new carrier if there already exists a module for it! Using a module will be much faster and more accurate!' => 'Bemærk: Registrer IKKE et nyt leveringsfirma, hvis der allerede eksisterer et modul til det! Det er meget hurtigere og mere nøjagtigt at anvende et modul!',
    'The carrier\'s name will be displayed during checkout.' => 'Navnet på leveringsmetoden vil blive vist i løbet af købsprocessen.',
