    'Improve your SEO' => 'Forbedr din SEO',
    'Edit information about your pages to gain visibility and therefore reach more visitors. We advise you to start with the index page, it stands for your homepage.' => 'Rediger information om dine sider og opnå synlighed og derigennem nå flere besøgende. Vi anbefaler at du starter med indekseringssiden, som står for din hjemmeside.',
