  'AdminShopparametersHelp' => 
  array (
    'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.' => 'Der er en enorm mængde af data, så hver forbindelse, der svarer til en henvisning, bliver indekseret. Du kan opdatere dette indeks ved at klikke på knappen nedenfor. Vær opmærksom på, at det kan tage lang tid, og det kun er nødvendigt, hvis du enten ændrer eller tilføjer en henvisning, eller ønsker dine ændringer med tilbagevirkende kraft.',
    'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.' => 'Dine data bliver cachelagret for at sortere og filtrere dem. Du kan opdatere cachelageret ved at klikke på knappen "Opdater cachelager".',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Direkte trafik kræver mange ressourcer. Du bør kun slå dette til, hvis du har en hurtig databaseserver og et stort behov for funktionen.',
    'Show me more' => 'Vis mere',
    'Definitions:' => 'Definitioner:',
    'The "http_referer" field is the website from which your customers arrive.' => 'Feltet "http_referer" er det websted, hvor dine kunder kommer fra.',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'F.eks. vil kunder, der kommer fra Google have en "http_referer" som denne: "http://www.google.com/search?q=prestashop".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'Hvis feltet "http_referer" er tomt, skyldes det, at den besøgende er kommet direkte til butikken, f. eks. ved at skrive URLen til butikken eller via et bookmark.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Så hvis du vil se alle de besøgende, der kommer fra Google, skriver du \\"%google\\" i dette felt - eller \\"%google.fr\\", hvis du f.eks. kun vil se de besøgende, der kommer fra fransk Google.',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'Feltet "request_uri" er den URL-adresse, som kunderne kommer fra til dit websted.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'Hvis den besøgende for eksempel åbner en vareside, vil URL-adressen se sådan ud: "%smusic-ipods/1-ipod-nano.html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'Det er interessant, fordi du kan tilføje nogle tags eller tokens i linkene, der peger på din webshop.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'Du kan for eksempel opslå et link (såsom "%sindex.php?myuniquekeyword". Bemærk, at du tilføjede "?myuniquekeyword" til sidst i URL-adressen) i et onlineforum eller som en blogkommentar og få statistikker over besøgende for det entydige link ved at indtaste "%%myuniquekeyword" i feltet "request_uri".',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'Denne metode er mere pålidelig end den med "http_referer", men der er en ulempe. Hvis en søgemaskine henviser til en side med dit link, så bliver det vist i søgeresultaterne, og du vil ikke alene angive besøgende fra de steder, hvor du opslog linket, men også dem fra søgemaskinerne, der registrerede det link.',
    'The "Include" fields indicate what has to be included in the URL.' => 'Feltet "inkluder" angiver, hvad der skal inkluderes i URLen.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'Feltet "ekskluder" angiver, hvad der skal ekskluderes fra URLen.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'Når der anvendes Simpel-tilstand, kan du bruge en lang række generiske tegn til at erstatte andre tegn:',
    '"_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".' => '"_" erstatter ét tegn. Hvis du vil benytte det rigtige "_", skal du skrive sådan her: "\\\\_".',
    '"%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" erstatter et vilkårligt antal tegn. Hvis du vil benytte det rigtige "%", skal du skrive sådan her: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'Metoden Simple benytter MySQLs "LIKE" mønstermatching. En mere slagkraftig løsning kan opnås ved at benytte MySQLs regulære udtryk i eksperttilstand.',
    'Take a look at MySQL\'s documentation for more details.' => 'Læs mere om MySQL i dokumentationen.',
    'Get help!' => 'Få hjælp!',
    'e.g. 10:00AM - 9:30PM' => 'f.eks. 10.00 - 21.30',
    'Further information regarding this contact.' => 'Yderligere oplysninger om denne kontakt.',
    'Image width in pixels. Enter "0" to use the original size.' => 'Billedbredde i pixels. Indtast "0" for at bruge oprindelig størrelse.',
    'Image height in pixels. Enter "0" to use the original size.' => 'Billedehøjde i pixels. Indtast "0" for at bruge oprindelig størrelse.',
    'The group defined for your un-identified visitors.' => 'Gruppen der er defineret for dine uidentificerede besøgende.',
    'The group defined for your identified guest customers (used in guest checkout).' => 'Gruppen for dine identificerede gæstekunder (bruges ved gæstebetaling).',
    'The group defined for your identified registered customers.' => 'Gruppen der er defineret for dine identificerede registrerede kunder.',
    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Værdien bliver automatisk tilgængelig for ALLE butikkens varer for medlemmer i denne kundegruppe.',
    'How prices are displayed in the order summary for this customer group.' => 'Hvordan priserne vises på ordreresuméet for denne kundegruppe (inkl. eller ekskl. moms).',
    'Customers in this group can view prices.' => 'Kunder i denne gruppe kan se priser.',
    '%group_name% - All persons without a customer account or customers that are not logged in.' => '%group_name% - Alle personer uden en kundekonto eller kunder som ikke er logget på.',
    '%group_name% - All persons who placed an order through Guest Checkout.' => '%group_name% - Alle personer som placerede en ordre via Gæste udtjekning.',
    '%group_name% - All persons who created an account on this site.' => '%group_name% - Alle personer som oprettede en konto på dette websted.',
    'PrestaShop has three default customer groups:' => 'PrestaShop har tre standard kundegrupper:',
    'Need to hide prices for all groups? Save time, enable catalog mode in Product Settings instead.' => 'Brug for at skjule priser for alle grupper? Spar tid, aktiver katalog tilstand under produktindstillinger i stedet.',
    'Leave blank if no change.' => 'Efterlad blank, hvis ingen ændring.',
    'Fee given for each visit.' => 'Honorar betalt for hvert besøg.',
    'Fee given for each order placed.' => 'Honorar betalt for hver ordre placeret.',
    'If you know how to use MySQL regular expressions, you can use the [1]expert mode[/1].' => 'Hvis du ved, hvordan man bruger MySQL regulære udtryk, kan du benytte [1]Eksperttilstand[/1].',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Aktiver automatisk indeksering af varerne. Hvis du aktiverer denne funktion, vil varerne automatisk blive indekseret i søgningen når de gemmes, men hvis funktionen er deaktiveret, bliver du nødt til at indeksere varerne manuelt ved hjælp af de links, der er fastsat i dette feltsæt.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'Som standard, for at søge efter "bluse" skal du skrive "bluse"; "blu", etc (start af ord) - og ikke f. eks "use" (del af ord).',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Med denne option aktiveret vil et godt søgeresultat også opnås for "luse" eller "use" eller andet, som er en del af ordet.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Aktiver søgning indeni ord, og ikke kun fra begyndelsen.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'Det undersøges om den søgte term findes i det indekserede ord. Dette kan være resourcekrævende.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'Som standard hvis du søger "bog", vil du få "bog"; "boghylde" og "bogstøtte".',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Med denne option aktiveret vil der kun komme et resultat "bog" da den eksakte ende af det indekserede ord passer.',
    'Enable more precise search with the end of the word.' => 'Aktiver mere præcis søgning med enden af ordet.',
    'It checks if the searched term is the exact end of the indexed word.' => 'Det undersøger om søgetermen er et eksakt match af det indekserede ord.',
    'Only words this size or larger will be indexed.' => 'Kun ord med mindst denne størrelse vil blive indekseret.',
    'Please enter the index words separated by a "|".' => 'Indtast venligst ordene adskilt af en "|".',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Indtast hvert alias separeret med komma (,) (f.eks. \'prestshop,preztashop,prestasohp\').',
    'Forbidden characters: <>;=#{}' => 'Forbudte tegn: <>;=#{}',
    'Search this word instead.' => 'Søg på dette ord i stedet',
    'By default, the fuzzy search is enabled. It means spelling errors are allowed, e.g. you can search for "bird" with words like "burd", "bard" or "beerd".' => 'Som standard er den slørede søgning aktiveret. Det betyder at stavefejl er tilladt, fx kan du søger efter "fugl" med ord som "figl", "fogl" eller "fuugl".',
    'Enable approximate string matching.' => 'Aktiver cirka streng matchning.',
    'Note that this option is resource-consuming: the more you search, the longer it takes.' => 'Bemærk at denne indstilling er ressourcekrævende: jo mere du søger, jo længere tid tager det.',
    'Disabling this option will require exact spelling for the search to match results.' => 'Deaktivering af denne indstilling vil kræve præcis stavemåde for at søgningen matcher resultater.',
    'Only words fewer or equal to this maximum length will be searched.' => 'Der vil kun blive søgt efter ord der er kortere eller lig med denne maksimum længde.',
    'This parameter will only be used if the fuzzy search is activated: the lower the value, the more tolerant your search will be.' => 'Denne parameter bruges kun hvis fuzzy søgningen er aktiveret: jo mindre værdi, jo større tolerance vil din søgning udvise.',
    'This field does not refer to the shop name visible in the front office.' => 'Dette felt henviser ikke til butikkens synlige navn i Front Office.',
    'Follow [1]this link[/1] to edit the shop name used on the front office.' => 'Følg [1]dette link[/1] for at redigere butiksnavnet der anvendes i front office.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Du kan ikke redigere butiksgruppen, fordi den aktuelle butik tilhører en gruppe med valgmuligheden ʺdeleʺ aktiveret.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, [1]please click here[/1].' => 'Dette er rodkategorien for butikken som du har oprettet. For at definere en ny rodkategori for din butik, så [1]klik venligst her[/1].',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Ved at vælge forbundne kategorier, vælger du at dele kategorierne mellem forskellige butikker. Når butikkerne er forbundet, vil enhver ændring af forbundne kategorier påvirke alle de butikker, som disse kategorier berører.',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Upload et ikon fra din computer (filtype: .gif, anbefalet størrelse: 16x16).',
    'Whether or not to display this store.' => 'Om denne butik skal vises eller ej.',
    'Storefront picture.' => 'Billede til Front Office.',
    'Displayed in emails sent to customers.' => 'Bliver vist i e-mails sendt til kunder.',
    'Shop registration information (e.g. SIRET or RCS).' => 'Butiksinformation (f.eks. SIRET, RSC eller CVR-nummer).',
    'Contact name (e.g. Customer Support).' => 'Kontaktnavn (f.eks. Teknisk Support).',
    'Emails will be sent to this address.' => 'E-mails vil blive sendt til denne adresse.',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Hvis aktiveret, vil alle beskeder blive gemt i "Kundeservice" siden under "Kunde" menuen.',
    'After a customer logs in, you can recall and display the content of his/her last shopping cart.' => 'Når kunden logger ind, genkaldes og vises indholdet af hans/hendes sidste indkøbskurv.',
    'Minimum time required between two requests for a password reset.' => 'Minimum tid der kræves, før adgangskoden kan nulstilles igen.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Aktiver eller deaktiver B2B tilstand. Når denne indstilling er aktiveret, er B2B funktioner tilgængelige.',
    'Display or not the birth date field.' => 'Vis eller vis ikke feltet Fødselsdato.',
    'Display or not the partner offers tick box, to receive offers from the store\'s partners.' => 'Vis eller vis ikke afkrydningsfeltet til partnertilbud for at modtage tilbud fra butikkens partnere.',
    'Send an email with a summary of the account information after registration.' => 'Send en e-mail med et sammendrag af kontoinformationen efter registreringen.',
    'We recommend that you deactivate your store while performing maintenance. Note that it will not disable the webservice.' => 'Vi anbefaler at du deaktiverer butikken i mens du udfører vedligehold. Bemærk at det ikke vil deaktivere webservicen.',
    'Allow IP addresses to access the store, even in maintenance mode. Use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96).' => 'Tillad IP adresser at tilgå butikken selvom den er i vedligeholdelsestilstand. Anvend et komma for at separere dem (fx 42.24.4.2,127.0.0.1,99.98.97.96).',
    'Display a customized message when the store is disabled.' => 'Vis en brugredefineret besked når butikken er deaktiveret.',
    'If you own an SSL certificate for your shop\'s domain name, you can activate SSL encryption (https://) for customer account identification and order processing.' => 'Hvis du ejer et SSL certifikat til din shops domænenavn, kan du aktivere SSL encryption (https://) for kundekonto identificering og ordre proccessering.',
    'When enabled, all the pages of your shop will be SSL-secured.' => 'Gennemtving anvendelse af SSL på hele din butik.',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Aktiver eller deaktiver token i Butik for at forøge sikkerheden for PrestaShop.',
    'Allow iframes on text fields like product description. We recommend that you leave this option disabled.' => 'Tillad iframes på tekstfelter såsom varebeskrivelse. Vi anbefaler at du lader være denne indstilling deaktiveret.',
    'Clean the HTML content on text fields. We recommend that you leave this option enabled.' => 'Ryd HTML indhold på tekstfelter. Vi anbefaler at du lader denne indstilling være aktiveret.',
    'You can choose among 6 different ways of rounding prices. "Round up away from zero ..." is the recommended behavior.' => 'Du kan vælge mellem 6 forskellige måder at afrunde priser på. "Rund op fra væk fra nul ..." er den anbefalede opførsel.',
    'You can choose when to round prices: either on each item, each line or the total (of an invoice, for example).' => 'Du kan vælge hvornår priser skal afrundes: enten på hvert emne, hver linje eller totalen (på en faktura for eksempel).',
    'Enable best sellers page on your front office even when its respective module is disabled.' => 'Aktiver Bedste sælgende side på shoppen også selv om det modul der styrer det er deaktiveret.',
    'The multistore feature allows you to manage several e-shops with one Back Office. If this feature is enabled, a "Multistore" page will be available in the "Advanced Parameters" menu.' => 'Multistorefunktionen giver dig mulighed for at styre flere butikker med Back Office. Hvis denne funktion er aktiveret, vil en "Multistore" side være tilgængelig under "Avancerede parametre" i menuen..',
    'Enable suppliers page on your front office even when its module is disabled.' => 'Aktiver leverandør side i dit front office, selvom dets modul er deaktiveret.',
    'Enable brands page on your front office even when its module is disabled.' => 'Aktiver mærke siden i dit front office, selvom dets modul er deaktiveret.',
    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Vis en oversigt over adresserne, leveringsmetode og indkøbskurven lige før ordreknappen (påkrævet i nogle europæiske lande).',
    'Allow guest visitors to place an order without registering.' => 'Alle gæstebesøgende kan lave en ordre uden af registrere sig.',
    'Disable the option to allow customers to reorder in one click from the order history page (required in some European countries).' => 'Deaktiver muligheden for at kunder kan genbestille med ét klik fra ordrehistorik siden (krævet i nogle europæiske lande).',
    'Set to 0 to disable this feature.' => 'Angiv til 0 for at deaktivere denne funktion.',
    'Automatically updates the shipping costs when you edit an order.' => 'Leveringsomkostningerne opdateres automatisk, når du redigerer en ordre.',
    'Require customers to accept or decline terms of service before processing an order.' => 'Kræv, at kunderne accepterer eller afviser Handelsbetingelser, før ordren bliver behandlet.',
    'Choose the page which contains your store\'s terms and conditions of use.' => 'Vælg den side, der indeholder butikkens Handelsbetingelser.',
    'Allow the customer to ship orders to multiple addresses. This option will convert the customer\'s cart into one or more orders.' => 'Tillad kunden at sende sin ordre til forskellige adresser. Denne indstilling vil konvertere kundens indkøbskurv til en eller flere ordrer.',
    'It allows you to delay shipping if your customers request it.' => 'Det giver dig mulighed for at forsinke leveringen hvis din kunde har efterspurgt dette.',
    'Suggest gift-wrapping to customers.' => 'Foreslå gaveindpakning til kunden, og muligheden for at efterlade en besked.',
    'Set a price for gift wrapping.' => 'Angiv en pris for gaveindpakning.',
    'Set a tax for gift wrapping.' => 'Angiv moms for gaveindpakning.',
    'Suggest recycled packaging to customer.' => 'Foreslå genanvendt emballage til kunden.',
    'Only letters, numbers and underscores ("_") are allowed.' => 'Kun bogstaver, numre og undersore ("_") er tilladt.',
    'Email template for both .html and .txt.' => 'E-mail skabelon for både .html og .txt.',
    'characters' => 'tegn',
    'Note that the label will be displayed only if backorders are denied.' => 'Bemærk at labelen kun vil blive vist, hvis backordrer er nægtede.',
    'Enable this option if you want to display your product\'s attributes in its meta title.' => 'Aktiver denne indstilling, hvis du ønsker at vise dine varers attributter i dets metatitel.',
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Aktiver kun denne indstilling hvis din server tillader URL omskrivning (anbefalet).',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'URL omskrivning (mod_rewrite) er enten ikke aktiv på din server, eller også er det ikke muligt at kontrollere din serverkonfiguration. Hvis du vil bruge brugervenlige URLs skal du aktivere denne.',
    'Enable this option only if you have problems with URL rewriting.' => 'Aktiver kun denne indstilling, hvis du har problemer med URL omskrivning på nogle sider.',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Nogle af PrestaShops funktioner virker måske ikke korrekt med en specifik konfiguration af Apaches mod_security modul. Vi anbefaler at deaktivere det.',
    'Enable this option if you want to allow accented characters in your friendly URLs. You should only activate this option if you are using non-Latin characters; for all the Latin charsets, your SEO will be better without this option.' => 'Aktiver denne indstilling hvis du vil tillade accentuerede karakterer i dine venlige URLer. Du bør kun aktivere denne indstilling hvis du anvender ikke-latinske karakterer; for alle de latinske karakterer, vil dine SEO være bedre uden denne indstilling.',
    'The catalog mode is actually to disable products checkout (prices, add to cart, etc.) on your shop, like a retail website does.' => 'Katalogtilstanden er til at deaktivere muligheden for, at placere varer i indkøbskurven (priser, tilføj til indkøbskurv, etc.) i din butik, som et engros websted gør.',
    'Set the maximum size of the summary of your product description (in characters).' => 'Angiv maksimumstørrelsen for den kortfattede gengivelse af din produktbeskrivelse (i antal tegn).',
    'How to calculate quantity discounts.' => 'Hvordan mængderabat udregnes.',
    'When active, friendly URL will be updated on every save.' => 'Hvis aktiv, så vil venlig URL blive opdateret hver gang der gemmes.',
    'When active, new products will be activated by default during creation.' => 'Når funktionen er aktiv, aktiveres nye varer som standard, når de oprettes.',
    'Catalog mode disables the shopping cart on your store. Visitors will be able to browse your products catalog, but not buy them.' => 'Katalogtilstand deaktiverer indkøbskurven i din butik. Besøgende kan gennemse dit produktkatalog, men ikke købe varer.',
    'Have specific needs? Edit particular groups to let them see prices or not.' => 'Har du specialbehov? Rediger specifikke grupper for at lade dem se priser eller ej.',
    'Display product prices when in catalog mode.' => 'Vis produktpriser hvis i katalogtilstand.',
    'Set to "0" to disable this feature.' => 'Sæt til 0 for at deaktivere denne funktion.',
    'Display or hide the "add to cart" button on category pages for products that have attributes forcing customers to see product details.' => 'Vis eller skjul "Tilføj til indkøbskurv" knappen på kategorisider for varer, der har egenskaber, så kunden tvinges til at se varedetaljer.',
    'In the volume discounts board, display the new price with the applied discount instead of showing the discount (ie. "-5%").' => 'Vis den nye pris med rabat i mængderabatoversigten i stedet for at vise rabatten (f.eks. "-5%").',
    'Display the "%add_to_cart_label%" button when a product has attributes' => 'Vis knappen "%add_to_cart_label%", når varen har egenskaber',
    'Display or hide the "%add_to_cart_label%" button on category pages for products that have attributes forcing customers to see product details.' => 'Vis eller skjul knappen "%add_to_cart_label%" på kategorisider for varer der har attributter, så kunden tvinges til at se varedetaljer.',
    'If an attribute is not available in every product combination, it will not be displayed.' => 'Hvis en attribut ikke er tilgængelig i hvert produktkombination, så vil den ikke vises.',
    'Number of products displayed per page. Default is 10.' => 'Antal af varer vist pr. side. Standard er 10',
    'The order in which products are displayed in the product list.' => 'Standard rækkefølge for vareliste.',
    'Default order method for product list.' => 'Standard rækkefølge for vareliste.',
    'By default, the Add to Cart button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Som standard, vil knappen Læg i indkøbskurv være skjult når en vare ikke er tilgængelig. Du kan vælge altid at få den vist.',
    'Advised for European merchants to be legally compliant (eg: Delivered within 3-4 days)' => 'Anbefalet for Europæiske forhandlere for at opfylde loven (fx: Leveret indenfor 3-4 dage)',
    'Advised for European merchants to be legally compliant (eg: Delivered within 5-7 days)' => 'Anbefalet for europæiske forhandlere for at opfylde loven (fx: Leveret indenfor 5-7 dage)',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Hvordan skal lagerbeholdningen beregnes, når du sælger produktpakker?',
    'By default, the "%add_to_cart_label%" button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Som standard, vil knappen "%add_to_cart_label%" være skjult når en vare ikke er tilgængelig. Du kan vælge altid at få den vist.',
    'Allows you to delay shipping at your customers\' request.' => 'Lader dig udsætte levering på dine kunders anmodning.',
    'Invalid characters: numbers and' => 'Ugyldige tegn: numre og',
    'Status will be highlighted in this color. HTML colors only.' => 'Status vil blive fremhævet i denne farve. Kun HTML-farver.',
    'Order\'s return status name.' => 'Navn for returordrers status.',
    'Order status (e.g. \'Pending\').' => 'Ordrestatus (f.eks. \'Afventer\').',
    'You can search for a new domain name or add a domain name that you already own. You will be redirected to your PrestaShop account.' => 'Du kan søge efter et nyt domænenavn elle tilføje et domænenavn som du allerede ejer. Du vil blive omdirigeret til din PrestaShop konto.',
    'Invalid characters:' => 'Ugyldige tegn:',
    'Name of the related page.' => 'Navn på den relaterede side.',
    'Title of this page.' => 'Titel på denne side.',
    'A short description of your shop.' => 'En kort beskrivelse af din butik.',
    'List of keywords for search engines.' => 'Liste over søgeord for søgemaskiner.',
    'For instance, "contacts" for http://example.com/shop/contacts to redirect to http://example.com/shop/contact-form.php' => 'For eksempel, "kontakter" for at http://eksempel.dk/shop/kontakter omdirigerer til http://eksempel.dk/shop/contact-form.php',
    'Only letters and hyphens are allowed.' => 'Kun bogstaver og bindestreger er tilladte.',
    'To add tags, click in the field, write something, and then press the "Enter" key.' => 'For at tilføje tags, klik i feltet, skriv noget, og tryk så på "Enter" tasten.',
    'Enable this option if you want to allow accented characters in your friendly URLs.' => 'Aktiver denne indstilling hvis du ønsker at tillade karakterer med accent i dine venlige URL\'er.',
    'You should only activate this option if you are using non-latin characters ; for all the latin charsets, your SEO will be better without this option.' => 'Du bør kun aktivere denne indstilling, hvis du bruger ikke-latinske tegn; for alle latinske tegnsæt, vil din SEO være bedre uden denne indstilling.',
    'Activate or deactivate your shop (It is a good idea to deactivate your shop while you perform maintenance. Please note that the webservice will not be disabled).' => 'Aktiver eller deaktiver din butik. Det er en god idé at deaktivere din butik mens du laver vedligeholdelse på den. Bemærk venligst, at WebServicen ikke vil være deaktiveret.',
    'IP addresses allowed to access the front office even if the shop is disabled. Please use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96)' => 'IP-adresser, der har adgang til Front Office, selv hvis butikken er deaktiveret. Brug komma til at adskille dem (f.eks. 42.24.4.2,127.0.0.1,99.98.97.96)',
    'Custom text displayed on maintenance page while shop is deactivated.' => 'Brugerdefineret tekst, der vises på vedligeholdelsessiden, når butikken er deaktiveret.',
    'If you want to enable SSL on all the pages of your shop, activate the "Enable on all the pages" option below.' => 'Hvis du ønsker at aktivere SSL på alle sider på din shop, skal du aktivere "Tillad på alle sider" nedenfor.',
    'Choose how many decimals you want to display' => 'Vælg hvor mange decimaler du ønsker at vise',
    'Enable brands and suppliers pages on your front office even when their respective modules are disabled.' => 'Aktivér varemærke- og leverandørsider i din butik, også selvom de pågældende moduler er deaktiveret.',
  ),
  'AdminShopparametersNotification' => 
  array (
    'Caution: The discount applied to a category does not stack with the overall reduction but instead replaces it.' => 'Advarsel: Rabatten, der anvendes til en kategori, sammenlægges ikke med den samlede reduktion, men erstatter den i stedet.',
    'Only products that have this category as the default category will be affected.' => 'Kun varer, der har denne kategori som standard, vil blive påvirket.',
    'The module \'%s\' must be activated and configurated in order to have all the statistics' => 'Modulet "%s" skal være aktiveret og konfigureret for at få vist alle statistikker',
    'You cannot delete this shop (customer and/or order dependency)' => 'Du kan ikke slette denne butik (kunde- og/eller ordreafhængig)',
    'Click here to set a URL for this shop.' => 'Klik her for at angive URLen for denne butik.',
    'Width and height must be numeric values.' => 'Bredde og højde skal være numerisk værdi.',
