    'Is not a valid alias' => 'Er ikke et gyldigt alias',
    'Creation successful' => 'Oprettelse succesfuld',
    'We are thrilled to introduce you to the fuzzy search, one of the new features from 1.7.7! Please note that it is still in beta version, so feel free to share improvement ideas on GitHub to have it enhanced.' => 'Vi er glade for at kunne introducere dig til sløret søgning, en af de nye funktionaliteter i 1.7.7! Bemærk venligst at det stadig er i  beta version, så del endelig forslag til forbedringsideer på GitHub for at optimere det.',
    'This is not a valid IP address:' => 'Ugyldig IP adresse:',
    'You cannot delete this shop (customer and/or order dependency).' => 'Du kan ikke slette denne butik (kunde- og/eller ordreafhængig).',
    'Please create some sub-categories for this root category.' => 'Opret venligst underkategorier til hovedkategorien.',
    'You need to select at least the root category.' => 'Du skal vælge mindst en hovedkategori.',
    'Warning: You won\'t be able to change the group of this shop if this shop belongs to a group with one of these options activated: Share Customers, Share Quantities or Share Orders.' => 'Advarsel: Du vil ikke være i stand til at ændre denne gruppe i denne butik, hvis denne butik tilhører en gruppe, hvor en af disse muligheder er aktiveret: Dele Kunder, Dele Mængder eller Dele Ordrer.',
    'You can only move your shop to a shop group with all "share" options disabled -- or to a shop group with no customers/orders.' => 'Du kan kun flytte din butik til en butiksgruppe med alle ʺdeleʺ indstillinger deaktiveret, eller til en butiksgruppe uden kunder/ordrer.',
    'For security reasons, you cannot delete default order statuses.' => 'Af sikkerhedshensyn kan du ikke slette standard ordrestatusser.',
    'An address located in a country containing states must have a state selected.' => 'En adresse, der befinder sig i et land med stater, skal have valgt en stat.',
    'Latitude and longitude are required.' => 'Breddegrad og længdegrad skal angives.',
    'The specified state is not located in this country.' => 'Den angivne stat er ikke placeret i dette land.',
    'Before being able to use this tool, you need to:' => 'For du kan benytte dette værktøj, skal du:',
    'Create a blank .htaccess in your root directory.' => 'Opret en blank .htaccess i din hovedmappe.',
    'Give it write permissions (CHMOD 666 on Unix system).' => 'Giv den skriverettigheder (CHMOD 666 på Unix system).',
    'The Base URI is not valid.' => 'Grund URL\'en er ikke gyldig.',
    'An order status with the same name already exists: %s' => 'En ordrestatus med det samme navn eksisterer allerede: %s',
    'You must define an SMTP server and an SMTP port. If you do not know it, use the PHP mail() function instead.' => 'Du skal angive en SMTP server og en SMTP port. Hvis det ikke siger dig noget, vælg da PHP\'s mail() funktion i stedet.',
    'Assign a valid page if you want it to be read.' => 'Tildel en gyldig side, hvis du ønsker, at den skal læses.',
    'Your robots.txt file MUST be in your website\'s root directory and nowhere else (e.g. http://www.example.com/robots.txt).' => 'Din robots.txt fil SKAL være i rodmappen for dit websted og ikke andre steder (fx http://www.eksempel.dk/robots.txt).',
    'Generate your "robots.txt" file by clicking on the following button (this will erase the old robots.txt file)' => 'Generere din ʺrobots.txtʺ fil ved at klikke på følgende knap (dette vil slette din gamle robots.txt fil)',
    '1) Create a blank robots.txt file in your root directory.' => '1) Opret en tom robots.txt fil i din rodmappe.',
    'Before you can use this tool, you need to:' => 'Inden du kan anvende dette værktøj, skal du:',
    '2) Give it write permissions (CHMOD 666 on Unix system).' => '2) Giv den skriverettigheder (CHMOD 666 på Unix system).',
    '1) Create a blank .htaccess file in your root directory.' => '1) Oprette en tom .htaccess fil i din rod mappe.',
    'Here you can set the URL for your shop. If you migrate your shop to a new URL, remember to change the values below.' => 'Her kan du sætte URL\'en på din shop. Hvis du migrere din shop til en ny URL, så husk at ændre værdierne nedenunder.',
    'The multistore option is enabled. If you want to change the URL of your shop, you must go to the "Multistore" page under the "Advanced Parameters" menu.' => 'Multistoreindstilling er aktiveret, hvis du ønsker at ændre URLen på din butik, du er nødt til at gå til "Multistore" siden under "Advancerede parametre" i menuen.',
    'This section enables you to change the default pattern of your links. In order to use this functionality, PrestaShop\'s "Friendly URL" option must be enabled, and Apache\'s URL rewriting module (mod_rewrite) must be activated on your web server.' => 'Denne sektion gør det muligt for dig at ændre standardmønstret for dine links. For at anvende denne funktionalitet, så skal PrestaShops indstilling "Venlig URL" være aktiveret, og Apaches URL omskrivnings modul (mod_rewrite) skal også være aktiveret på din webserver.',
    'There are several available keywords for each route listed below; note that keywords with * are required!' => 'Der er flere tilgængelige nøgleord for hver rute listet nedenunder; bemærk at nøgleord med en * er krævet!',
    'To add a keyword in your URL, use the {keyword} syntax. If the keyword is not empty, you can add text before or after the keyword with syntax {prepend:keyword:append}. For example {-hey-:meta_title} will add "-hey-my-title" in the URL if the meta title is set.' => 'For at tilføje et nøgleord i din URL, anvend syntaksen {keyword}. Hvis nøgleordet ikke er tomt, så kan du tilføje mere tekst inden eller efter nøgleordet med syntaksen {prepend:keyword:append}. For eksempel {-hey-:meta_title} vil tilføje "-hey-my-title" i URLen hvis metatitlen er sat.',
    'You can only display the page list in a shop context.' => 'Du kan kun vise sidelisten i en butikssammenhæng.',
  ),
