    'PrestaShop requires at least 32 MB of memory to run: please check the memory_limit directive in your php.ini file or contact your host provider about this.' => 'PrestaShop kræver mindst 32 MB hukommelse for at køre: kontroller venligst memory_limit direktivet i din php.ini fil eller kontakt din webudbyder omkring dette.',
    '<b>Warning: You cannot use this tool to upgrade your store anymore.</b><br /><br />You already have <b>PrestaShop version %version% installed</b>.<br /><br />If you want to upgrade to the latest version, please read our documentation: <a href="%doc%">%doc%</a>' => '<b>Advarsel: Du kan ikke længere anvende dette værktøj til at opgradere din butik.</b><br /><br />Du har allerede <b>PrestaShop version %version% installeret</b>.<br /><br />Hvis du ønsker at opgradere til den seneste version, så læs venligst vores dokumentation: <a href="%doc%">%doc%</a>',
    'Welcome to the PrestaShop %version% Installer' => 'Velkommen til installationen af PrestaShop %version%',
    'Installing PrestaShop is quick and easy. In just a few moments, you will become part of a community consisting of more than 250,000 merchants. You are on the way to creating your own unique online store that you can manage easily every day.' => 'Det hurtigt og nemt at installere Prestashop. I løbet af få minutter, vil du blive en del af et fællesskab, der består af mere end 250.000 handlende. Du er på vej til at skabe din egen unikke online butik, som du kan administrere nemt hver dag.',
