    '<b>Warning: You cannot use this tool to upgrade your store anymore.</b><br /><br />You already have <b>PrestaShop version %version% installed</b>.<br /><br />If you want to upgrade to the latest version, please use the 1-Click Upgrade module and follow its instructions.' => '<b>Advarsel: Du kan ikke anvende dette værktøj til at opgradere din butik længere.</b><br /><br />Du har allerede installeret <b>PrestaShop version %version%</b>.<br /><br />Hvis du ønsker at opgradere til den seneste version, så anvend venligst 1-klik opgraderingsmodulet og følg dets instruktioner.',
