  'ModulesPagesnotfoundAdmin' => 
  array (
    'Pages not found' => 'Sider ikke fundet',
    'Adds a tab to the Stats dashboard, showing the pages requested by your visitors that have not been found.' => 'Tilføjer en fane til statistik kontrolpanelet, der viser de sider som dine besøgende har efterspurgt, men som ikke blev fundet.',
