    'Guide' => 'Vejledning',
    '404 errors' => '404 fejl',
    'A 404 error is an HTTP error code which means that the file requested by the user cannot be found. In your case it means that one of your visitors entered a wrong URL in the address bar, or that you or another website has a dead link. When possible, the referrer is shown so you can find the page/site which contains the dead link. If not, it generally means that it is a direct access, so someone may have bookmarked a link which doesn\'t exist anymore.' => 'En 404 fejl er en HTTP fejlkode, som betyder, at den fil der blev efterspurgt af brugeren, ikke kan findes. I dit tilfælde betyder det at en af dine besøgende indtastede en forkert URL i adressefeltet i sin browser, eller at din shop eller et andet website har et dødt link. Hvis det er muligt, vises henviseren, så du kan finde den side/det site, som rummer det døde link. Hvis ikke, er det typisk fordi det er en direkte absolut URL som ikke eksisterer længere, som nogen f. eks. har gemt som et bogmærke.',
    'How to catch these errors?' => 'Hvordan man fanger disse fejl?',
    'If your webhost supports .htaccess files, you can create one in the root directory of PrestaShop and insert the following line inside: "%s".' => 'Hvis din webudbyder understøtter .htaccess filer, så kan du oprette en i rodmappen af PrestaShop og indsætte følgende linje i den: "%s".',
    'A user requesting a page which doesn\'t exist will be redirected to the following page: %s. This module logs access to this page.' => 'En bruger som forespørger en side som ikke eksisterer vil blive omdirigeret til den følgende side: %s. Dette modul logger adgang til denne side.',
