  'ModulesStatspersonalinfosAdmin' => 
  array (
    'Registered customer information' => 'Info for registrerede kunder',
    'Adds information about your registered customers (such as gender and age) to the Stats dashboard.' => 'Tilføjer information om dine registrerede kunder (såsom køn og alder) på statistik opslagstavæen.',
    'Target your audience' => 'Målret dit publikum',
    'In order for each message to have an impact, you need to know who it is being addressed to. ' => 'For at hver enkelt besked skal have en virkning, skal du vide, hvem den adresseres til.',
    'Defining your target audience is essential when choosing the right tools to win them over.' => 'Henvendelse til den rigtige målgruppe er afgørende for at vælge de rigtige værktøjer, og ikke mindst, til at vinde over dem.',
    'It is best to limit an action to a group -- or to groups -- of clients.' => 'Det er bedst at begrænse en handling til en gruppe -- eller til grupper -- af klienter.',
