  'ModulesStatsregistrationsAdmin' => 
  array (
    'Customer accounts' => 'Kundekonti',
    'Adds a registration progress tab to the Stats dashboard.' => 'Tilføjer en registreringsproces fane til statistik opslagstavlen.',
    'Number of visitors who stopped at the registering step:' => 'Besøgende, der er stoppet ved registreringstrinnet:',
    'Number of visitors who placed an order directly after registration:' => 'Besøgende, der har placeret en ordre direkte efter registrering:',
    'Total customer accounts:' => 'Kundekonti i alt:',
    'Number of customer accounts created' => 'Antal kundekonti oprettet',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Det samlede antal konti, der oprettes, er ikke i sig selv vigtige oplysninger. Men det er gavnligt at analysere antallet oprettede over tid. Dette angiver, om man er på rette spor.',
    'How to act on the registrations\' evolution?' => 'Hvordan forholder man sig til udviklingen i registreringer?',
    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Hvis du lader din butik køre uden at ændre noget, vil mængden af kunderegistreringer forblive stabil eller vise et svagt fald.',
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'En væsentlig stigning eller nedgang i kunderegistreringer viser, at der sandsynligvis har været en ændring i din butik. Med det i tankerne, foreslår vi at du identificerer grunden, retter problemet og kommer tilbage i kampen om at tjene penge!',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Her er en oversigt over, hvad kan påvirke oprettelsen af en kundekonto:',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'En reklamekampagne kan tiltrække et større antal besøgende til din online butik. Dette vil højst sandsynligt blive efterfulgt af en øgning i kundekontoer og profitmarginer, som vil afhænge af kunde "kvalitet". Målrettede reklamer er typisk mere effektive end stor-skala reklamering.. og det er også billigere!',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Tilbud, udsalg og/eller konkurrencer fanger ofte kundernes opmærksomhed og nysgerrighed. Ved at tilbyde dette i din butik holder du ikke kun din butik levende, det vil også højne trafikken, opbygge kundeloyalitet og gennemgående ændre din aktuelle e-handels filosofi.',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'Design og brugervenlighed er vigtigere end nogensinde før: et dårligt valgt eller ikke brugervenligt grafisktema kan afskrække besøgende. Du skal finde den rette balance mellem en nyskabende design og udlejning besøgende let flytte. Korrekt stavning og klarhed også inspirere flere kundernes tillid til din butik.',
    'CSV Export' => 'CSV eksport',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track.' => 'Det totale antal af konti der er oprettet er ikke i sig selv vigtig information. Det er dog nyttigt for at analysere antallet der er oprettet over tid. Dette vil indikere om tingene kører på det rigtige spor.',
  ),
