  array (
    'Sales and orders' => 'Salg og ordrer',
    'Adds graphics presenting the evolution of sales and orders to the Stats dashboard.' => 'Tilføjer en grafisk repræsentation af udviklingen af salg og ordrer på statistik kontrolpanelet.',
    'About order statuses' => 'Om ordrestatusser',
    'In your Back Office, you can modify the following order statuses: Awaiting Check Payment, Payment Accepted, Preparation in Progress, Shipping, Delivered, Canceled, Refund, Payment Error, Out of Stock, and Awaiting Bank Wire Payment.' => 'I dit Back Office kan du ændre følgende ordrestatusser: Afventer betaling med check, Betaling accepteret, Forberedelse i gang, Afsender, Afsendt, Annulleret, Refunderet, Betalingsfejl, Ikke på lager og Afventer bankoverførsel.',
