    'You should often consult this screen, as it allows you to quickly monitor your shop\'s sustainability. It also allows you to monitor multiple time periods.' => 'Du bør ofte tjekke denne skærm, da den giver dig et hurtigt overblik over din butiks bæredygtighed. Den giver dig også mulighed for at monitorere forskellige tidsperioder.',
