    'This information is mostly qualitative. It is up to you to determine the interest of a disjointed visit.' => 'Disse oplysninger er for det meste kvalitative; du skal bestemme en usammenhængende besøgsinteresse.',
    'A visit corresponds to an internet user coming to your shop, and until the end of their session, only one visit is counted.' => 'Et besøg svarer til en internet-bruger kommer til din butik. Indtil slutningen af deres session tælles kun et besøg.',
    'A visitor is an unknown person who has not registered or logged into your store. A visitor can also be considered a person who has visited your shop multiple times.' => 'En besøgende er en ukendt person, som hverken er registreret eller er logget ind på din butik. En besøgende kan komme og besøge din butik mange gange.',
