  'ModulesWelcomeAdmin' => 
  array (
    'Let\'s create your first product' => 'Lad os oprette din første vare',
    'What do you want to tell about it? Think about what your customers want to know.' => 'Hvad har du lyst til at fortælle? Tænk på, hvad dine kunder gerne vil vide.',
