    'A module that hasn\'t been verified may be dangerous and could add hidden functionalities like backdoors, ads, hidden links, spam, etc. Don’t worry, this alert is simply a warning.' => 'Et modul, som ikke er blevet bekræftet, kan være farligt og kan tilføje skjulte funktionaliteter såsom bagdøre, reklamer, skjulte links, spam osv. Der er ingen grund til bekymring, denne meddelelse er blot en advarsel.',
    'PrestaShop, being an open-source software, has an awesome community with a long history of developing and sharing high quality modules. Before installing this module, making sure its author is a known community member is always a good idea (by checking [1]our forum[/1] for instance).' => 'PrestaShop, som er en open source-software, har et formidabelt fællesskab med en lang historie med at udvikle og dele moduler af høj kvalitet. Inden du installerer modulet, er det altid en god idé at sørge for, at forfatteren er et kendt fællesskabsmedlem (ved for eksempel at besøge [1]vores forum[/1]).',
    'If you trust or find the author of this module to be an active community member, you can proceed with the installation.' => 'Hvis du har tillid til eller finder ud af, at modulets forfatter er et aktivt medlem af fællesskabet, kan du fortsætte med installationen.',
    'Otherwise you can look for similar modules on the official marketplace. [1]Click here to browse PrestaShop Addons[/1].' => 'Ellers kan du kigge efter lignende moduler på den officielle markedsplads. [1]Klik her for at gennemse PrestaShop Addons[/1].',
    'Back' => 'Tilbage',
    'This module could not be verified by PrestaShop.' => 'Dette modul kunne ikke verificeres af PrestaShop.',
    'Since you may not have installed this module from PrestaShop Addons, we cannot assert that the module is complying with our safety requirements (e.g. that it is not adding some undisclosed functionalities such as ads, hidden links, spam, etc...).' => 'Da du muligvis ikke har installeret dette modul fra PrestaShop Addons, kan vi ikke garantere, at modulet overholder alle vores sikkerhedskrav (f.eks. at det ikke tilføjer ukendte funktionaliteter som reklamer, skjulte links, spam osv.).',
    'You can search for similar modules on the official marketplace.' => 'Du kan søge efter lignende moduler på den officielle markedsplads.',
    '[1]Click here to browse our catalog on PrestaShop Addons[/1].' => '[1]Klik her for at gennemse vores katalog på PrestaShop Addons[/1].',
    'This generally happens when the module isn\'t distributed through our official marketplace, PrestaShop Addons - or when your server failed to communicate with PrestaShop Addons.' => 'Dette sker som regel, når modulet ikke distribueres gennem vores officielle markedsplads, PrestaShop Addons - eller når din server ikke kunne kommunikere med PrestaShop Addons.',
